INSERT INTO `tbl_client` (`client_id`, `client_nama`, `deskripsi_client`, `client_gambar`, `jabatan`) VALUES
(8, 'Nurul Adilah', 'Ishlahul Ummah is a great place to develop myself, tidak hanya menjadi tempat untuk belajar tetapi juga sebagai wadah untuk eksplorasi diri dan mengembangkan minat bakat dengan lingkungan nyaman, teman-teman yang baik, dan dewan pengajarnya yang suportif.', '35914e64e4018522b13527c8c01ece93.png', 'Alumni - Sekarang Kuliah di Fakultas Kedokteran Universitas'),
(9, 'Syifa Nuroniah', 'Ishlahul Ummah Boarding School, Alhamdulillah pernah diberi kesempatan untuk menghabiskan 6 tahun saya di sana. Bagi saya IU merupakan tempat yang tepat untuk menimba berbagai ilmu dan pengalaman, karena di sana tidak hanya diajarkan hal yang berkaitan dengan akademik saja, tapi juga banyak kesempatan untuk menguasai kegiatan non akademik dari program unggulan dan ekstrakurikuler yang ditawarkan. Selain itu, Ishlahul Ummah juga bagus dalam pembentukan karakter kemandirian, kedisiplinan, juga pengendalian emosi. I am proud to be part of Ishlahul Ummah Boarding School.', 'eaedaaab098af675894209445b315991.png', 'Alumni - sekarang kuliah di Al Azhar University, Cairo.');
INSERT INTO `tbl_faq` (`id_faq`, `pertanyaan`, `jawaban`, `status`, `href`, `active`, `gambar`) VALUES
(50, 'KIR (Karya Ilmiah Remaja)', 'Kelompok remaja yang melakukan serangkaian kegiatan yang menghasilkan karya ilmiah. KIR merupakan organisasi yang sifatnya terbuka bagi para remaja yang ingin mengembangkan kreativitas, ilmu pengetahuan, dan teknologi pada masa kini maupun masa yang akan datang', 1, '1', '', '1a63f9dfe8ccf6954dd4fb85e319130e.png'),
(51, 'Muhadhoroh ', 'Muhadhoroh merupakan kegiatan yang mengasah kemampuan public speaking, melatih mental dan kelancaran saat didepan umum, dan melatih bahasa yang digunakan saat muhadhoroh, kegiatan tersebut biasanya berupa pidato mengenai topik topik tertentu', 2, '1', '', 'b44a9dac2cc1f03719b8e3da2aaf5022.jpeg'),
(52, 'Jurnalistik', 'Ekskul jurnalistik merupakan ekstrakurikuler yang bertujuan untuk mengasah kemampuan menulis santriwati khususnya media cetak dan media daring, kemampuan berpikir kritis, analis dan detail.', 1, '2', '', '6409590f97a4428af0f2da949a1c8649.png'),
(53, 'Math Club', 'Tujuan Ekstrakurikuler Math Club adalah membentuk generasi pelajar yang menguasai Ilmu Matematika dan mampu bersaing dengan pelajar lain serta bermanfaat bagi masyarakat.', 1, '3', '', 'b4fe4929da9554bd460ee3f58b7662bd.png'),
(54, 'English Club', 'English Club adalah sebuah wadah bagi para mahasiswa dalam menyalurkan minat dan bakat serta pengetahuan di bidang Bahasa Inggris.', 1, '4', '', '3b71d6bd29e11023f32fc9606b7c8be7.png'),
(55, 'Multimedia', 'Ekstrakurikuler Multimedia merupakan kegiatan mempelajari software desain grafis seperti corel draw, canva, photoshop dan aplikasi lainnya untuk mengembangkan kreativitas santriwati dalam menggambar secara digital.', 1, '5', '', 'c1b987f99bc81b381b03a30331ac93a5.png'),
(56, 'Taekwondo', 'Salah satu bela diri yang ada di Ishlahul Ummah adalah Taekwondo, bela diri ini berasal dari Korea Selatan yang sudah tersebar ke seluruh negara. Bahkan Indonesia sudah mencatat banyak prestasi yang ditorehkan. Pesantren Ishlahul Ummah sendiri memiliki banyak anggota Taekwondo beserta pelatihnya yang berprestasi', 1, '6', '', 'c38b77e8c5cb082fc0f4ee2ef4012b1b.png'),
(57, 'Paskibra', 'Tujuan ekstrakurikuler Paskibra adalah Menanamkan semangat nasionalisme dan patriotism. Menumbuhkan sikap cinta tanah air dan bangsa. Menumbuhkan sikap jasmani yang tegas dan tangkas.', 1, '7', '', '3833f4a078a44ad97a4c11613debacf6.png'),
(58, 'Kaligrafi', 'Kegiatan dimana siswa belajar membuat huruf kaligrafi dengan teknik dan pengerjaan yang benar.', 1, '8', '', 'f92d7121d3f61e900e5cbaa7fafc9e42.png'),
(59, 'Menggambar', 'Ekstrakurikuler menggambar merupakan kegiatan yang mengembangkan kreativitas santriwati dalam hal menggambar.', 1, '9', '', '56f671b9ed75e6ff5d343d5e9cf0f216.png'),
(60, 'Pencak Silat', 'Pencak silat merupakan seni bela diri Tradisional asli asal Indonesia. Banyak sekali peminat bela diri ini mulai dari lokal sampai mancanegara, di Ishlahul Ummah sendiri sudah memiliki banyak anggota beserta pelatih yang siap berprestasi', 1, '10', '', '968e5836656b326ddfe259bbc779f46f.png'),
(61, 'Bola Voli', 'Ekstrakurikuler bola voli merupakan media untuk mendorong prestasi non akademik, pertumbuhan fisik dan perkembangan psikis, meningkatkan kemampuan dan keterampilan dalam bermain bola voli supaya lebih baik, serta pembiasaan pola hidup sehat dengan berolahraga.', 1, '11', '', '3e830df357e70321116d004926f6cd25.png'),
(62, 'Muhadatsah', 'Muhadatsah dalam Bahasa arab berasal dari kata hadatsa yang berarti bicara kemudian mendapat huruf tambahan menjadi haadatsa yang berarti berbicara yang berfungsi sebagai musyarakah (persekutuan). Kemudian mashdar dari haadatsa yaitu muhadatsah. Jadi muhadatsah adalah percakapan antara dua orang atau lebih yang saling timbal balik.', 2, '2', '', 'cff36ef51e7c457ee845afa1a361d764.png'),
(63, 'Pramuka', 'Pramuka bertujuan membentuk peserta didik untuk memiliki kepribadian yang beriman, bertakwa, berakhlak mulia, berjiwa patriotik, taat hukum, disiplin, menjunjung tinggi nilai-nilai luhur bangsa, berkecakapan hidup, sehat jasmani, dan rohani. Kedua, kepramukaan harus mampu membentuk peserta didik agar menjadi warga Negara Pacasilais, setia dan patuh kepada Negara Kesatuan Republik Indonesia serta menjadi anggota masyarakat yang baik dan berguna .', 2, '3', '', 'db5c24ce1041d53709482fa3e11c4837.jpeg');
