(3, '263ad5ebfe064e6545d20b6c8ca2783d.png', 'Pondok Pesantren Ishlahul Ummah Tasikmalaya', 'Pondok Pesantren Ishlahul Ummah', 'l. Cieunteung No. 80 Blk Meubel Sakura Rt 05/Rw 04 Kel.Argasari Kec.Cihideung Kota Tasikmalaya - Jawa Barat - Indonesia 46122', '<p><strong>Pondok Pesantren Ishlahul Ummah adalah Pesantren Khusus Putri yang berdasarkan nilai-nilai Ahlus Sunnah Wal Jamaah . Pesantren yang mempunyai motto &quot;Sholehah, Cerdas dan Mandiri&quot; ini berdiri pada tahun 2007. Pesantren ini didukung dengan sarana dan prasarana yang memadai. tujuannya untuk meningkatkan perkembangan santriwati agar mencapai berbagai keunggulan secara optimal.</strong></p>\r\n', 'smpitiubs@gmail.com', '6281211140017', 'https://web.facebook.com/iubs.tasikmalaya', ' https://www.tiktok.com/@iubs.tasikmalaya?_t=8U9uAlFflfF&_r=1', 'https://www.linkdin.com', 'https://www.google.com', '', 'https://www.instagram.com/iubs.tasikmalaya', '', ' https://www.youtube.com/channel/UCaHIwh7ZVu0GdpfBo1xYHkQ', '', '');
