INSERT INTO `tbl_pengumuman` (`pengumuman_id`, `pengumuman_judul`, `pengumuman_deskripsi`, `pengumuman_tanggal`, `pengumuman_author`, `pengumuman_gambar`, `pengumuman_slug`, `link_download`, `pengumuman_view`) VALUES
(12, 'Pendaftaran Santriwati Baru tahun ajaran 2023/2024 telah dibuka!', 'Pendaftaran Santriwati Baru SMP IT dan SMA IT Ishlahul Ummah Boarding School Tasikmalaya Gelombang 1 telah dibuka!!!\r\n\r\nDalam mewujudkan komitmen tersebut, kami memiliki 4 program unggulan yakni:\r\n\r\n1. Tahfidz Mutqin \r\n2. Bahasa Internasional\r\n3. IT\r\n4. Keputrian\r\n\r\nSelain itu, terdapat banyak ekstrakurikuler yang bisa diikuti oleh santriwati dan telah mencetak berbagai prestasi non-akademik! yuk daftar sekarang juga! ????\r\n\r\nPeriode gelombang 1: 1 September - 4 Desember 2022.\r\n\r\n???? Link Pendaftaran: https://linktr.ee/ppdbiubs2023\r\n\r\n?? Narahubung: \r\nSMP : 0812-1114-0017 (Ustadzah Herlin Lidiawati, S.Pd.)\r\nSMA : 0811-2223-724 (Ustadzah Fanny Nurhanifa, S.Pd.)\r\n\r\n\"Mendidik satu perempuan sama dengan mendidik satu generasi\". (Dr. Moh. Hatta)', '2022-09-20 03:32:59', '', 'fa86051d7c1e80cdb58c787956c3c55c.png', 'pendaftaran-santriwati-baru-tahun-ajaran-2023/2024-telah-dibuka!', 'https://linktr.ee/ppdbiubs2023', 0),
(13, 'Pengumuman bagi yang ingin melakukan survey kunjungan', 'Bagi orang tua / calon santriwati yang ingin berkunjung ke Pondok Pesantren Ishlahul Ummah Tasikmalaya untuk melakukan survey, kami akan menerima kunjungan tersebut sesuai dengan hari dan jam kunjungan yang sudah kami tentukan dan diharapkan para bapak/ibu dan calon santriwati memenuhi protokol kesehatan standar ketika melakukan kunjungan.\r\n\r\nJadwal Kunjungan : Senin - Sabtu Pukul 08.00 s/d 11.00 WIB\r\n\r\nAlamat Kami :\r\nJl. Cieunteung,blk Meubel Sakura No.80, RT.05/RW.04, Argasari, Kec. Cihideung, Kota Tasikmalaya, Jawa Barat 46122', '2022-09-20 03:35:41', '', 'c869523252faf0573ad07145ebb4c21c.jpg', 'pengumuman-bagi-yang-ingin-melakukan-survey-kunjungan', '', 0);
