(174, 'Selamat Hari Angklung Sedunia', '<p>Selamat Hari Angklung Sedunia!<br />\r\nMari kita bersama-sama lestarikan warisan budaya bangsa ??<br />\r\n<br />\r\n~<br />\r\n<br />\r\nPondok Pesantren Ishlahul Ummah, pesantren para hafidzah Qur&#39;an telah membuka pendaftaran santriwati baru gelombang 1, yuk segera daftar sebelum kuotanya habis!<br />\r\n<br />\r\nNarahubung:<br />\r\n<br />\r\n1. SMP : 0812-1114-0017<br />\r\n(Ustadzah Herlin Lidiawati, S.Pd.)<br />\r\n<br />\r\n2. SMA : 0811-2223-724<br />\r\n(Ustadzah Fanny Nurhanifa, S.Pd.)<br />\r\n<br />\r\n&quot;Mendidik satu perempuan, mendidik satu generasi&quot;. (Dr. Moh. Hatta)</p>\r\n', '2022-11-17 06:16:25', 8, 'Profil', 300, '91cc61a1d3357ee3d08fe8a4024dd944.jpg', 1, 'Admin Santri', 0, 'selamat-hari-angklung-sedunia', NULL, NULL, ''),
(175, 'Selamat Memperingati Hari Ayah Nasional!', '<p>Selamat memperingati hari Ayah Nasional!<br />\r\n<br />\r\nA father&#39;s love never ends<br />\r\n<br />\r\n12 November 2022<br />\r\n<br />\r\n~<br />\r\n<br />\r\nPondok Pesantren Ishlahul Ummah, pesantren para hafidzah Qur&#39;an telah membuka pendaftaran santriwati baru gelombang 1, yuk segera daftar sebelum kuotanya habis!<br />\r\n<br />\r\nNarahubung:<br />\r\n<br />\r\n1. SMP : 0812-1114-0017<br />\r\n(Ustadzah Herlin Lidiawati, S.Pd.)<br />\r\n<br />\r\n2. SMA : 0811-2223-724<br />\r\n(Ustadzah Fanny Nurhanifa, S.Pd.)<br />\r\n<br />\r\n&quot;Mendidik satu perempuan, mendidik satu generasi&quot;. (Dr. Moh. Hatta)<br />\r\n&nbsp;</p>\r\n', '2022-11-17 06:18:02', 8, 'Profil', 0, '93aa792aade1bbd5a693bb980bc0c5d2.jpg', 1, 'Admin Santri', 0, 'selamat-memperingati-hari-ayah-nasional!', NULL, NULL, ''),
