(179, 'Santri Di Kunjungi', '<p>Coba</p>\r\n', '2022-11-19 05:05:26', 5, 'Penelitian', 128, '5f351c48d732f017250362916f0679ac.jpg', 1, 'Admin Santri', 0, 'santri-di-kunjungi', NULL, NULL, ''),
(180, 'Gebyar Bulan Bahasa berjalan lancar', '<p>Dalam rangka memperingati hari Sumpah Pemuda, SMP IT dan SMA IT Ishlahul Ummah Tasikmalaya mengadakan sebuah acara bertajuk Gebyar Bulan Bahasa dengan tema &quot;Ciptakan karya dengan bahasa!&quot;<br />\r\n<br />\r\nTerdapat 6 mata lomba pada acara tersebut yakni :<br />\r\n<br />\r\n1. Baca Puisi<br />\r\n2. Cerpen<br />\r\n3. Story Telling<br />\r\n4. Dongeng Basa Sunda<br />\r\n5. News Reading<br />\r\n6. Pidato Bahasa Arab<br />\r\n<br />\r\nProgram ini merupakan salah satu implementasi dari program unggulan kami yaitu Bahasa Internasional. Walaupun begitu, penampilan Lomba Basa Sunda dan Baca Puisi dari para peserta juga ciamik!<br />\r\n<br />\r\nSemoga acara ini bermanfaat bagi santriwati dan bisa menyalurkan bakat mereka dalam berbahasa, dan semoga bisa menjadi perwakilan di lomba tingkat kota sampai, Nasional! Aamiin.</p>\r\n', '2022-11-19 05:58:33', 8, 'Profil', 95, 'cccf5f28107e7866651ec29aa671d169.jpg', 1, 'Admin Santri', 0, 'gebyar-bulan-bahasa-berjalan-lancar', NULL, NULL, ''),
