INSERT INTO `tbl_tulisan` (`tulisan_id`, `tulisan_judul`, `tulisan_isi`, `tulisan_tanggal`, `tulisan_kategori_id`, `tulisan_kategori_nama`, `tulisan_views`, `tulisan_gambar`, `tulisan_pengguna_id`, `tulisan_author`, `tulisan_img_slider`, `tulisan_slug`, `tulisan_tags_id`, `tulisan_tags_nama`, `link_driv`) VALUES
(182, 'RESENSI BUKU TARBIYATUL AULAD ABDULLAH NASHIH ULWAN', '<p>Kitab &ldquo;Tarbiyatul Aulad Fil Islam&rdquo; memiliki karakteristik tersendiri. Keunikan karakteristik itu terletak pada uraiannya yang menggambarkan totalitas dan keutamaan Islam. Islam sebagai agama yang tertinggi dan tidak ada yang melebihi ketinggiannya adalah menjadi obsesi Ulwan dalam setiap analisa dan argumentasinya, sehingga tidak ada satu bagian pun dalam kitab tersebut yang uraiannya tidak didasarkan atas dasar-dasar dan kaidah-kaidah nash.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kitab ini disusun dalam tiga bagian atau &ldquo;qism&rdquo; yang kronologis, masing-masing bagian memuat beberapa pasal dan setiap pasal mengandung beberapa topik pembahasan. Judul-judul dan pasal-pasal dalam setiap bagian itu akan tersusun sebagai berikut ini :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian pertama terdiri dari empat pasal, yaitu:</p>\r\n\r\n<p>a. Pasal pertama adalah perkawinan teladan dalam kaitannya dengan pendidikan.</p>\r\n\r\n<p>b. Pasal kedua adalah perasaan psikologis terhadap anak-anak.</p>\r\n\r\n<p>c. Pasal ketiga adalah hukum umum dalam hubungannya dengan anak yang lahir.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pasal ini terdiri dari empat bahasan :</p>\r\n\r\n<p>1. Pertama , adalah yang dilakukan oleh pendidik ketika lahir.</p>\r\n\r\n<p>2. Kedua , yaitu penamaan anak dan hukumnya.</p>\r\n\r\n<p>3. Ketiga , adalah aqiqah anak dan hukumnya.</p>\r\n\r\n<p>4. Keempat , adalah menyunatkan anak dan hukumnya.</p>\r\n\r\n<p>d. Pasal keempat adalah sebab-sebab kelainan pada anak dan penanggulangannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian kedua yaitu tanggung jawab terbesar bagi para pendidik, bagian ini terdiri dari tujuh pasal adalah sebagai berikut :</p>\r\n\r\n<p>a. Pasal pertama adalah tanggung jawab pendidikan Iman.</p>\r\n\r\n<p>b. Pasal kedua adalah tanggung jawab pendidikan moral.</p>\r\n\r\n<p>c. Pasal ketiga adalah tanggung jawab pendidikan fisik</p>\r\n\r\n<p>d. Pasal keempat adalah tanggung jawab pendidikan intelektual.</p>\r\n\r\n<p>e. Pasal kelima adalah tanggung jawab pendidikan psikologis.</p>\r\n\r\n<p>f. Pasal keenam adalah tanggung jawab pendidikan sosial.</p>\r\n\r\n<p>g. Pasal ketujuh adalah tanggung jawab pendidikan seksual.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian ketiga terdiri dari tiga pasal dan penutup :</p>\r\n\r\n<p>a. Pasal pertama adalah faktor-faktor pendidikan yang berpengaruh.</p>\r\n\r\n<p>b. Pasal kedua adalah dasar-dasar fundamental dalam mendidik anak.</p>\r\n\r\n<p>c. Pasal ketiga berisi saran-saran paedagogis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian pertama sampai dengan bagian ketiga tersebut, terdapat dalam jilid I. Sedangkan dalam jilid II, meliputi tiga pasal, yaitu :</p>\r\n\r\n<p>a. Pasal pertama adalah metode pendidikan yang influentif terhadap anak.</p>\r\n\r\n<p>b. Pasal kedua adalah kaidah-kaidah elementer dalam pendidikan anak.</p>\r\n\r\n<p>c. Pasal ketiga adalah gagasan edukatif yang sangat esensial.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Fokus kajian skripsi ini terdapat dalam jilid II pasal pertama yang berisi tentang metode pendidikan yang influentif terhadap anak pada halaman dua dan seterusnya. Ulwan memaparkan 5 metode mendidik moral anak dalam keluarga. Diantara metode-metode pendidikan moral anak dalam keluarga adalah :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pendidikan dengan keteladanan.</p>\r\n\r\n<p>Pendidikan dengan adat kebiasaan.</p>\r\n\r\n<p>Pendidikan dengan nasihat.</p>\r\n\r\n<p>Pendidikan dengan memberikan perhatian.</p>\r\n\r\n<p>Pendidikan dengan memberikan hukuman.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila metode-metode tersebut diterapkan dalam pendidikan anak khususnya dalam keluarga, maka secara bertahap mereka para orang tua mempersiapkan anak-anaknya untuk menjadi anggota masyarakat yang berguna bagi kehidupan dan pasukan-pasukan yang kuat untuk kepentingan Islam (sebagai penegak ajaran-ajaran Islam dalam kehidupan).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C. Metode Pendidikan Moral Anak dalam Keluarga menurut Abdullah Nashih Ulwan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sarana untuk membentuk keluarga dalam Islam harus melalui ikatan pernikahan. Dengan melangsungkan pernikahan, maka pasangan suami istri akan memperoleh manfaat dari pernikahan tersebut. Salah satu manfaatnya adalah memelihara kelangsungan jenis manusia di dunia yang fana ini. Kelahiran anak merupakan amanat dari Allah SWT kepada bapak dan ibu sebagai pemegang amanat yang harusnya dijaga, dirawat, dan diberikan pendidikan. Itu semua merupakan bagian dari tanggung jawab orang tua kepada anaknya.</p>\r\n\r\n<p>Anak dilahirkan tidak dalam keadan lengkap dan tidak pula dalam keadaan kosong. Ia dilahirkan dalam keadaan fitrah. Memang ia dilahirkan dalam keadaan tidak tahu apa-apa, akan tetapi anak telah dibekali dengan pendengaran, penglihatan, dan kata hati.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dengan diberikannya penglihatan, pendengaran, dan kata hati tersebut, diharapkan orang tua harus mampu membimbing, mengarahkan, dan mendidiknya dengan ekstra hati-hati karena anak sebagai peniru yang ulung. Oleh karena itu semaksimal mungkin orang tua memberikan pelayanan terhadap anaknya. Pelayanan yang maksimal akan menghasilkan suatu harapan bagi bapak ibunya, tiada lain suatu kebahagiaan hasil jerih payahnya. Sebab anak adalah sumber kebahagiaan, kesenangan, dan sebagai harapan dimasa yang akan datang.[8] Harapan-harapan orang tua akan terwujud, tatkala mereka mempersiapkan sedini mungkin pendidikan yang baik sebagai sarana pertumbuhan dan perkembangan bagi anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Memang diakui bahwa mengemudikan bahtera rumah tangga yang baik, yang sakinah, dan yang maslahah merupakan tugas kewajiban yang sangat rumit, tidak kalah rumitnya dengan mengelola sebuah pabrik, dan tidak kalah canggihnya dengan mengemudikan pesawat terbang karena orang tua harus siap untuk memperpadukan sekian banyak unsur dan dimensi mulai dari dimensi sikap mental, ilmu pengetahuan, ketrampilan dan lain sebagainya. Sebagai kewajiban dari orang tua, dalam hal ini adalah pemegang amanat, maka barang siapa yang mampu menjaga amanat tersebut akan diberi pahala, dan sebaliknya. Hal ini sesuai dengan janji Allah SWT dalam firmanya, QS.al-Kahfi (18) : 46.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Harta dan anak-anak adalah perhiasan kehidupan dunia, tetapi amalan-amalan yang kekal lagi saleh adalah lebih baik pahala disisi Tuhanmu serta lebih baik untuk menjadi harapan&rdquo;. (QS. Al-Kahfi : 46)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam mendidik anak, tentunya harus ada kesepakatan antara bapak ibu sebagai orang tua, akan dibawa kepada pendidikan yang otoriter atau pendidikan yang demokratis atau bahkan yang liberal, sebab mereka penentu pelaksana dalam keluarga.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam kehidupan masyarakat terkecil, yaitu keluarga, suami secara fungsional adalah penanggung jawab utama rumah tangga (keluarga) sedangkan istri adalah mitra setia yang aktif konstruktif mengelola rumah tangga. Operasionalisasi kehidupan berkeluarga sebaiknya dilakukan berdasarkan amar makruf nahi munkar.</p>\r\n\r\n<p>Salah satu wujud amar makruf nahi munkar dalam kehidupan berkeluarga adalah memberikan pendidikan kepada putra putrinya berdasarkan ajaran Islam. Antara keluarga satu dengan keluarga lainnya mempunyai prinsip dan sistem sendiri-sendiri dalam mendidik anaknya. Namun orang tua jangan terbuai atau melupakan terhadap ajaran-ajaran Islam, terutama dalam hal pendidikan anak sebagaimana yang telah dicontohkan Rasul saw. sebagai pembawa panji-panji Islam, Rasul SAW tidak pernah mendidik putra-putrinya dengan pendidikan keras dan tidak dengan membebaskan anak-anaknya, tetapi beliau dalam mendidik keluarganya terutama kepada anak-anaknya adalah dengan limpahan kasih sayang yang amat besar. Senada dengan yang dikatakan oleh sahabat Anas ra. yaitu &ldquo;aku tidak mendapatkan seseorang yang kasih sayangnya pada keluarganya melebihi Rasulullah SAW.&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Seorang muslim sepatutunya mencontoh teladan yang telah diberikan Rasul SAW, dalam memuliakan putra putrinya. Beliau dalam mendidik anak-anaknya melalui ajaran wahyu Ilahi yaitu dengan penuh kasih sayang terhadap anak-anaknya. Dengan pemberian kasih sayang tersebut, diharapkan dapat menunjang pertumbuhan dan perkembangan anak. Sebab anak merupakan aset masa depan. Sebagai orang tua dapat meneladani ajaran-ajaran Rasul SAW tersebut, melalui para pemikir dan pemerhati pendidikan (anak) dalam Islam. Salah satu pemerhati pendidikan (anak) dalam Islam yang memberikan gambaran yang benar sesuai dengan ajaran Islam adalah Ulwan. Ia memberikan pandangannya dalam mendidik anak dalam keluarga melalui metode-metode yang harus diterapkan dalam pendidikan anak termasuk dalam hal pendidikan moral. Apabila metode-metode tersebut diterapkan, niscaya apa yang menjadi harapan bersama sebagai muslimin yaitu tumbuhnya para generasi Islam yang tangguh dan sebagai penebar kebenaran, dapat direalisasikan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Untuk mmemperoleh hasil yang baik dalam pelaksanaan pendidikan (moral) maka harus memenuhi beberapa faktor-faktornya. Salah satu faktornya adalah metode. Metode merupakan sarana untuk menyampaikan isi atau materi pendidikan tersebut, agar tujuan yang diharapkan dapat tercapai dengan hasil yang baik.</p>\r\n\r\n<p>Diantara metode pendidikan moral anak dalam keluarga yang ditawarkan oleh Abdullah Nashih Ulwan adalah :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Pendidikan dengan keteladanan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Menurut al-Ghazali anak adalah amanat bagi orang tuanya. Hatinya yang suci merupakan permata tak ternilai harganya, masih murni dan belum terbentuk. Orang tuanya merupakan arsitek atau pengukir kepribadian anaknya. Sebelum mendidik orang lain, sebaiknya orang tua harus mendidik pada dirinya terlebih dahulu. Sebab anak merupakan peniru ulung. Segala informasi yang masuk pada diri anak, baik melalui penglihatan dan pendengaran dari orang di sekitarnya, termasuk orang tua akan membentuk karakter anak tersebut. Apalagi anak yang berumur sekitar 3-6 tahun, ia senantiasa melakukan imitasi terhadap orang yang ia kagumi (ayah dan ibunya). Rasa imitasi dari anak yang begitu besar, sebaiknya membuat orang tua harus ekstra hati-hati dalam bertingkah laku, apalagi didepan anak-anaknya. Sekali orang tua ketahuan berbuat salah dihadapan anak, jangan berharap anak akan menurut apa yang diperintahkan. Oleh karena itu sudah sepantasnya bagi orang tua pemegang amanat, untuk memberikan teladan yang baik kepada putra putrinya dalam kehidupan berkeluarga. Keluarga merupakan sekolah pertama bagi anak. Orang tua terutama ibu merupakan pendidik pertama dan utama bagi anak dalam membentuk pribadinya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ibu mempengaruhi anak melalui sifatnya yang menghangatkan, menumbuhkan rasa diterima, dan menanamkan rasa aman pada diri anak. Sedangkan ayah mempengaruhi anaknya melalui sifatnya yang mengembangkan kepribadian, menanamkan disiplin, memberikan arah dan dorongan serta bimbingan agar anak tambah berani dalam menghadapi kehidupan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Teladan yang baik dari orang tua kepada anak (sekitar umur 6 tahun) akan berpengaruh besar kepada perkembangan anak di masa mendatang. Sebab kebaikan di waktu kanak-kanak awal menjadi dasar untuk pengembangan di masa dewasa kelak. Untuk itu lingkungan keluarga harus sebanyak mungkin memberikan keteladanan bagi anak. Dengan keteladanan akan memudahkan anak untuk menirunya. Sebab keteladanan lebih cepat mempengaruhi tingkah laku anak. Apa yang dilihatnya akan ia tirukan dan lama kelamaan akan menjadi tradisi bagi anak. Hal ini sesuai firman Allah SWT QS. al-Ahzab ( 33) : 21.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Sesungguhnya telah ada pada (diri) Rasulullah itu suri teladan yang baik bagimu (yaitu) bagi orang yang mengharap (rahmat) Allah dan (kedatangan) hari kiamat dan dia banyak menyebut Allah.&rdquo; (QS. Al-Ahzab : 21)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam hal keteladanan ini, lebih jauh Abdullah Nashih Ulwan menafsirkan dalam beberapa bentuk, yaitu :</p>\r\n\r\n<p>a. Keteladanan dalam ibadah.</p>\r\n\r\n<p>b. Keteladanan bermurah hati.</p>\r\n\r\n<p>c. Keteladanan kerendahan hati.</p>\r\n\r\n<p>d. Keteladanan kesantunan.</p>\r\n\r\n<p>e. Keteladanan keberanian.</p>\r\n\r\n<p>f. Keteladanan memegang akidah</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Karena obyeknya anak (kanak-kanak) tentunya bagi orang tua dalam memberikan teladan harus sesuai dengan perkembangannya sehingga anak mudah mencerna apa yang disampaikan oleh bapak ibunya. Sebagai contoh agar anak membiasakan diri dengan ucapan &ldquo;salam&rdquo;, maka senantiasa orang tua harus memberikan ajaran tersebut setiap hari yaitu hendak pergi dan pulang ke rumah (keteladanan kerendahan hati). Yang penting bagi orang tua tampil dihadapan anak sesuai dengan ajaran-ajaran Islam, niscaya semua itu akan ditirunya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Pendidikan dengan adat kebiasaan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Setiap manusia yang dilahirkan membawa potensi, salah satunya berupa potensi beragama. Potensi beragama ini dapat terbentuk pada diri anak (manusia) melalui 2 faktor, yaitu : faktor pendidikan Islam yang utama dan faktor pendidikan lingkungan yang baik. Faktor pendidikan Islam yang bertanggung jawab penuh adalah bapak ibunya. Ia merupakan pembentuk karakter anak. Hal ini sesuai dengan sabda Rasul SAW yang diriwayatkan oleh Muslim dan Abu Hurairah.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Dari Abi hurairah ra. telah bersabda Rasulullah SAW. tidak ada anak yang dilahirkan, kecuali dalam keadaan fitrah. Maka kedua orang tuanyalah yang akan menjadikannya sebagai orang yahudi, nasrani, atau majusi&rdquo;. (HR. Muslim)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Setelah anak diberikan masalah pengajaran agama sebagai sarana teoritis dari orang tuanya, maka faktor lingkungan harus menunjang terhadap pengajaran tersebut, yakni orang tua senantiasa memberikan aplikasi pembiasaan ajaran agama dalam lingkungan keluarganya. Sebab pembiasaan merupakan upaya praktis dan pembentukan (pembinaan) dan persiapan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pada umur kanak-kanak kecenderungannya adalah meniru apa yang dilakukan oleh orang-orang disekitarnya, baik saudara famili terdekatnya ataupun bapak ibunya. Oleh karena itu patut menjadi perhatian semua pihak, terutama orang tuanya selaku figur yang terbaik di mata anaknya. Jika orang tua menginginkan putra putrinya tumbuh dengan menyandang kebiasaan-kebiasaan yang baik dan akhlak terpuji serta kepribadian yang sesuai ajaran Islam, maka orang tua harus mendidiknya sedini mungkin dengan moral yang baik. Karena tiada yang lebih utama dari pemberian orang tua kecuali budi pekerti yang baik. Hal ini sesuai dengan sabda Rasul SAW yang diriwayatkan al-Tirmidzi dari Ayyub bin Musa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Diceritakan dari Ayyub bin Musa dari ayahnya dari kakeknya, bahwa Rasulullah saw bersabda : Tidak ada pemberian yang lebih utama dari seorang ayah kepada anaknya kecuali budi pekerti yang baik&rdquo;. (H.R At-Tirmidzi)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila anak dalam lahan yang baik (keluarganya) memperoleh bimbingan, arahan, dan adanya saling menyayangi antar anggota keluarga, niscaya lambat laun anak akan terpengaruh informasi yang ia lihat dan ia dengar dari semua perilaku orang&ndash; orang disekitarnya. Dan pengawasan dari orang tua sangat diperlukan sebagai kontrol atas kekeliruan dari perilaku anak yang tak sesuai dengan ajaran Islam.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. Pendidikan dengan Nasihat</p>\r\n\r\n<p>Pemberi nasihat seharusnya orang yang berwibawa di mata anak. Dan pemberi nasihat dalam keluarga tentunya orang tuanya sendiri selaku pendidik bagi anak. Anak akan mendengarkan nasihat tersebut, apabila pemberi nasihat juga bisa memberi keteladanan. Sebab nasihat saja tidak cukup bila tidak diikuti dengan keteladanan yang baik.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Anak tidak akan melaksanakan nasihat tersebut apabila didapatinya pemberi nasihat tersebut juga tidak melaksanakannya. Anak tidak butuh segi teoritis saja, tapi segi praktislah yang akan mampu memberikan pengaruh bagi diri anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nasihat yang berpengaruh, membuka jalannya ke dalam jiwa secara langsung melalui perasaan. Setiap manusia (anak) selalu membutuhkan nasihat, sebab dalam jiwa terdapat pembawaan itu biasanya tidak tetap, dan oleh karena itu kata&ndash;kata atau nasihat harus diulang&ndash;ulang. Nasihat akan berhasil atau mempengaruhi jiwa anak, tatkala orangtua mampu memberikan keadaan yang baik. Hal ini sesuai dengan firman Allah SWT dalam QS. al-Baqarah ( 2) : 44.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Mengapa kamu suruh orang lain (mengerjakan) kabaktian, sedang kamu melupakan diri (kewajiban) mu sendiri, Padahal kamu membaca al-Kitab (Taurat) ? maka tidakkah kamu berpikir ? (Q.S al-Baqarah : 44)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Agar harapan orang tua terpenuhi yakni anak mengikuti apa&ndash; apa yang telah diperintahkan dan yang telah diajarkannya, tentunya disamping memberikan nasihat yang baik juga ditunjang dengan teladan yang baik pula. Karena pembawaan anak mudah terpengaruh oleh kata&ndash;kata yang didengarnya dan juga tingkah aku yang sering dilihatnya dalam kehidupan sehari&ndash;hari dari pagi hari sampai sore hari.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nasihat juga harus diberikan sesering mungkin kepada anak&ndash;anak masa sekolah dasar, sebab anak sudah bersosial dengan teman sebayanya. Agar apa&ndash;apa yang telah diberikan dalam keluarganya tidak mudah luntur atau tepengaruh dengan lingkungan barunya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Penyajian atau memberikan nasihat itu ada pembagiannya, yaitu :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>a. Menyeru untuk memberikan kepuasan dengan kelembutan atau penolakan.</p>\r\n\r\n<p>Sebagai contohnya adalah seruan Lukman kepada anak&ndash;anaknya, agar tidak mempersekutukan Allah SWT. Q.S. Lukman (31) :13.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Dan (ingatlah) ketika Luqman berkata kepada anaknya, di waktu ia memberi pelajaran kepadanya : &ldquo;Hai anakku, janganlah kamu mempersekutukan Allah, Sesungguhnya mempersekutukan (Allah) adalah benar&ndash;benar kezaliman yang besar.&rdquo; (Q.S Luqman : 13).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>b. Metode cerita dengan disertai tamsil ibarat dan nasihat</p>\r\n\r\n<p>Metode ini mempunyai pengaruh terhadap jiwa dan akal. Biasanya anak itu menyenangi tentang cerita-cerita. Untuk itu orang tua sebisa mungkin untuk memberikan masalah cerita yang berkaitan dengan keteladanan yang baik yang dapat menyentuh perasaannya.Sebagaimana firman-Nya dalam QS. al-A`raf (7) : 176.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;&hellip; Maka ceritakanlah (kepada mereka) kisah-kisah itu agar mereka berpikir&rdquo;.[24]</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>c. Pengarahan melalui wasiat</p>\r\n\r\n<p>Orang tua yang bertanggung jawab tentunya akan berusaha menjaga amanat-Nya dengan memberikan yang terbaik buat anak demi masa depannya dan demi keselamatannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. Pendidikan dengan Perhatian</p>\r\n\r\n<p>Sebagai orangtua berkewajiban untuk memenuhi kebutuhan&ndash;kebutuhan anaknya, baik kebutuhan jasmani ataupun kebutuhan yang berbentuk rohani. Diantara kebutuhan anak yang bersifat rohani adalah anak ingin diperhatikan dalam perkembangan dan pertumbuhannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pendidikan dengan perhatian adalah mencurahkan, memperhatikan dan senantiasa mengikuti perkembangan anak dalam pembinaan akidah dan moral, persiapan spiritual dan sosial, disamping selalu bertanya tentang situasi pendidikan jasmani dan daya hasil ilmiahnya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Orang tua yang bijaksana tentunya mengetahui perkembangan-perkembangan anaknya. Dan ibu adalah pembentuk pribadi putra putrinya lebih besar prosentasenya dibanding seorang ayah. Tiap hari waktu Ibu banyak bersama dengan anak, sehingga wajar bila kecenderungan anak lebih dekat dengan para ibunya. Untuk itu ibu diharapkan mampu berkiprah dalam mempersiapkan pertumbuhan dan perkembangan putra-putrinya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Orang tua yang baik senantiasa akan mengoreksi perilaku anaknya yang tidak baik dengan perasaan kasih sayangnya, sesuai dengan perkembangan usia anaknya. Sebab pengasuhan yang baik akan menanamkan rasa optimisme, kepercayaan, dan harapan anak dalam hidupnya. Dalam memberi perhatian ini, hendaknya orang tua bersikap selayak mungkin, tidak terlalu berlebihan dan juga tidak terlalu kurang. Namun perhatian orang tua disesuaikan dengan perkembangan dan pertumbuhan anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila orang tua mampu bersikap penuh kasih sayang dengan memberikan perhatian yang cukup, niscaya anak-anak akan menerima pendidikan dari orang tuanya dengan penuh perhatian juga. Namun pangkal dari seluruh perhatian yang utama adalah perhatian dalam akidah.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. Pendidikan dengan memberikan hukuman</p>\r\n\r\n<p>Hukuman diberikan, apabila metode-metode yang lain sudah tidak dapat merubah tingkah laku anak, atau dengan kata lain cara hukuman merupakan jalan terakhir yang ditempuh oleh pendidik, apabila ada perilaku anak yang tidak sesuai dengan ajaran Islam. Sebab hukuman merupakan tindakan tegas untuk mengembalikan persoalan di tempat yang benar. Hukuman sesungguhnya tidaklah mutlak diberikan. Karena ada orang dengan teladan dan nasehat saja sudah cukup, tidak memerlukan hukuman. Tetapi pribadi manusia tidak sama seluruhnya. Sebenarnya tidak ada pendidik yang tidak sayang kepada siswanya. Demikian juga tidak ada orang tua yang merasa senang melihat penderitaan anaknya. Dengan memberikan hukuman, orang tua sebenarnya merasa kasihan terhadap anaknya yang tidak mau melaksanakan ajaran Islam. Karena salah satu fungsi dari hukuman adalah mendidik. Sebelum anak mengerti peraturan, ia dapat belajar bahwa tindakan tertentu benar apabila tidak menerima hukuman dan tindakan lainnya salah apabila mendapatkan suatu hukuman.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam memberikan hukuman ini diharapkan orang tua melihat ruang waktu dan tempatnya. Diantara metode memberikan hukuman kepada anak adalah :</p>\r\n\r\n<p>a. Menghukum anak dengan lemah lembut dan kasih sayang.</p>\r\n\r\n<p>b. Menjaga tabiat anak yang salah.</p>\r\n\r\n<p>c. Hukuman diberikan sebagai upaya perbaikan terhadap diri anak, dengan tahapan yang paling akhir dari metode-metode yang lain.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Memberi hukuman pada anak, seharusnya para orang tua sebisa mungkin menahan emosi untuk tidak memberi hukuman berbentuk badaniah. Kalau hukuman yang berbentuk psikologis sudah mampu merubah sikap anak, tentunya tidak dibutuhkan lagi hukuman yang menyakitkan anak tersebut. Hukuman bentuknya ada dua, yakni hukuman psikologis dan hukuman biologis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bentuk hukuman yang bersifat psikologis adalah :</p>\r\n\r\n<p>a. Menunjukkan kesalahan dengan pengarahan.</p>\r\n\r\n<p>b. Menunjukkan kesalahan dengan memberikan isyarat.</p>\r\n\r\n<p>c. Menunjukkan kesalahan dengan kecaman.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hukuman bentuk psikologis ini diberikan kepada anak dibawah umur 10 tahun. Apabila hukuman psikologis tidak mampu merubah perilaku anak, maka hukuman biologis lah yang dijatuhkan tatkala anak sampai umur 10 tahun tidak ada perubahan pada sikapnya. Hal ini dilakukan supaya anak jera dan tidak meneruskan perilakunya yang buruk. Sesuai sabda Rasul SAW yang diriwayatkan Abu Daud dari Mukmal bin Hisyam.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Suruhlah anak kalian mengerjakan shalat, sedang mereka berumur tujuh tahun, dan pukulilah mereka itu karena shalat ini, sedang mereka berumut sepuluh tahun, dan pisahkanlah tempat tidur mereka&rdquo;. (HR. Abu Daud)RESENSI BUKU TARBIYATUL AULAD ABDULLAH NASHIH ULWAN</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kitab &ldquo;Tarbiyatul Aulad Fil Islam&rdquo; memiliki karakteristik tersendiri. Keunikan karakteristik itu terletak pada uraiannya yang menggambarkan totalitas dan keutamaan Islam. Islam sebagai agama yang tertinggi dan tidak ada yang melebihi ketinggiannya adalah menjadi obsesi Ulwan dalam setiap analisa dan argumentasinya, sehingga tidak ada satu bagian pun dalam kitab tersebut yang uraiannya tidak didasarkan atas dasar-dasar dan kaidah-kaidah nash.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kitab ini disusun dalam tiga bagian atau &ldquo;qism&rdquo; yang kronologis, masing-masing bagian memuat beberapa pasal dan setiap pasal mengandung beberapa topik pembahasan. Judul-judul dan pasal-pasal dalam setiap bagian itu akan tersusun sebagai berikut ini :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian pertama terdiri dari empat pasal, yaitu:</p>\r\n\r\n<p>a. Pasal pertama adalah perkawinan teladan dalam kaitannya dengan pendidikan.</p>\r\n\r\n<p>b. Pasal kedua adalah perasaan psikologis terhadap anak-anak.</p>\r\n\r\n<p>c. Pasal ketiga adalah hukum umum dalam hubungannya dengan anak yang lahir.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pasal ini terdiri dari empat bahasan :</p>\r\n\r\n<p>1. Pertama , adalah yang dilakukan oleh pendidik ketika lahir.</p>\r\n\r\n<p>2. Kedua , yaitu penamaan anak dan hukumnya.</p>\r\n\r\n<p>3. Ketiga , adalah aqiqah anak dan hukumnya.</p>\r\n\r\n<p>4. Keempat , adalah menyunatkan anak dan hukumnya.</p>\r\n\r\n<p>d. Pasal keempat adalah sebab-sebab kelainan pada anak dan penanggulangannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian kedua yaitu tanggung jawab terbesar bagi para pendidik, bagian ini terdiri dari tujuh pasal adalah sebagai berikut :</p>\r\n\r\n<p>a. Pasal pertama adalah tanggung jawab pendidikan Iman.</p>\r\n\r\n<p>b. Pasal kedua adalah tanggung jawab pendidikan moral.</p>\r\n\r\n<p>c. Pasal ketiga adalah tanggung jawab pendidikan fisik</p>\r\n\r\n<p>d. Pasal keempat adalah tanggung jawab pendidikan intelektual.</p>\r\n\r\n<p>e. Pasal kelima adalah tanggung jawab pendidikan psikologis.</p>\r\n\r\n<p>f. Pasal keenam adalah tanggung jawab pendidikan sosial.</p>\r\n\r\n<p>g. Pasal ketujuh adalah tanggung jawab pendidikan seksual.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian ketiga terdiri dari tiga pasal dan penutup :</p>\r\n\r\n<p>a. Pasal pertama adalah faktor-faktor pendidikan yang berpengaruh.</p>\r\n\r\n<p>b. Pasal kedua adalah dasar-dasar fundamental dalam mendidik anak.</p>\r\n\r\n<p>c. Pasal ketiga berisi saran-saran paedagogis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian pertama sampai dengan bagian ketiga tersebut, terdapat dalam jilid I. Sedangkan dalam jilid II, meliputi tiga pasal, yaitu :</p>\r\n\r\n<p>a. Pasal pertama adalah metode pendidikan yang influentif terhadap anak.</p>\r\n\r\n<p>b. Pasal kedua adalah kaidah-kaidah elementer dalam pendidikan anak.</p>\r\n\r\n<p>c. Pasal ketiga adalah gagasan edukatif yang sangat esensial.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Fokus kajian skripsi ini terdapat dalam jilid II pasal pertama yang berisi tentang metode pendidikan yang influentif terhadap anak pada halaman dua dan seterusnya. Ulwan memaparkan 5 metode mendidik moral anak dalam keluarga. Diantara metode-metode pendidikan moral anak dalam keluarga adalah :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pendidikan dengan keteladanan.</p>\r\n\r\n<p>Pendidikan dengan adat kebiasaan.</p>\r\n\r\n<p>Pendidikan dengan nasihat.</p>\r\n\r\n<p>Pendidikan dengan memberikan perhatian.</p>\r\n\r\n<p>Pendidikan dengan memberikan hukuman.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila metode-metode tersebut diterapkan dalam pendidikan anak khususnya dalam keluarga, maka secara bertahap mereka para orang tua mempersiapkan anak-anaknya untuk menjadi anggota masyarakat yang berguna bagi kehidupan dan pasukan-pasukan yang kuat untuk kepentingan Islam (sebagai penegak ajaran-ajaran Islam dalam kehidupan).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C. Metode Pendidikan Moral Anak dalam Keluarga menurut Abdullah Nashih Ulwan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sarana untuk membentuk keluarga dalam Islam harus melalui ikatan pernikahan. Dengan melangsungkan pernikahan, maka pasangan suami istri akan memperoleh manfaat dari pernikahan tersebut. Salah satu manfaatnya adalah memelihara kelangsungan jenis manusia di dunia yang fana ini. Kelahiran anak merupakan amanat dari Allah SWT kepada bapak dan ibu sebagai pemegang amanat yang harusnya dijaga, dirawat, dan diberikan pendidikan. Itu semua merupakan bagian dari tanggung jawab orang tua kepada anaknya.</p>\r\n\r\n<p>Anak dilahirkan tidak dalam keadan lengkap dan tidak pula dalam keadaan kosong. Ia dilahirkan dalam keadaan fitrah. Memang ia dilahirkan dalam keadaan tidak tahu apa-apa, akan tetapi anak telah dibekali dengan pendengaran, penglihatan, dan kata hati.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dengan diberikannya penglihatan, pendengaran, dan kata hati tersebut, diharapkan orang tua harus mampu membimbing, mengarahkan, dan mendidiknya dengan ekstra hati-hati karena anak sebagai peniru yang ulung. Oleh karena itu semaksimal mungkin orang tua memberikan pelayanan terhadap anaknya. Pelayanan yang maksimal akan menghasilkan suatu harapan bagi bapak ibunya, tiada lain suatu kebahagiaan hasil jerih payahnya. Sebab anak adalah sumber kebahagiaan, kesenangan, dan sebagai harapan dimasa yang akan datang.[8] Harapan-harapan orang tua akan terwujud, tatkala mereka mempersiapkan sedini mungkin pendidikan yang baik sebagai sarana pertumbuhan dan perkembangan bagi anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Memang diakui bahwa mengemudikan bahtera rumah tangga yang baik, yang sakinah, dan yang maslahah merupakan tugas kewajiban yang sangat rumit, tidak kalah rumitnya dengan mengelola sebuah pabrik, dan tidak kalah canggihnya dengan mengemudikan pesawat terbang karena orang tua harus siap untuk memperpadukan sekian banyak unsur dan dimensi mulai dari dimensi sikap mental, ilmu pengetahuan, ketrampilan dan lain sebagainya. Sebagai kewajiban dari orang tua, dalam hal ini adalah pemegang amanat, maka barang siapa yang mampu menjaga amanat tersebut akan diberi pahala, dan sebaliknya. Hal ini sesuai dengan janji Allah SWT dalam firmanya, QS.al-Kahfi (18) : 46.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Harta dan anak-anak adalah perhiasan kehidupan dunia, tetapi amalan-amalan yang kekal lagi saleh adalah lebih baik pahala disisi Tuhanmu serta lebih baik untuk menjadi harapan&rdquo;. (QS. Al-Kahfi : 46)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam mendidik anak, tentunya harus ada kesepakatan antara bapak ibu sebagai orang tua, akan dibawa kepada pendidikan yang otoriter atau pendidikan yang demokratis atau bahkan yang liberal, sebab mereka penentu pelaksana dalam keluarga.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam kehidupan masyarakat terkecil, yaitu keluarga, suami secara fungsional adalah penanggung jawab utama rumah tangga (keluarga) sedangkan istri adalah mitra setia yang aktif konstruktif mengelola rumah tangga. Operasionalisasi kehidupan berkeluarga sebaiknya dilakukan berdasarkan amar makruf nahi munkar.</p>\r\n\r\n<p>Salah satu wujud amar makruf nahi munkar dalam kehidupan berkeluarga adalah memberikan pendidikan kepada putra putrinya berdasarkan ajaran Islam. Antara keluarga satu dengan keluarga lainnya mempunyai prinsip dan sistem sendiri-sendiri dalam mendidik anaknya. Namun orang tua jangan terbuai atau melupakan terhadap ajaran-ajaran Islam, terutama dalam hal pendidikan anak sebagaimana yang telah dicontohkan Rasul saw. sebagai pembawa panji-panji Islam, Rasul SAW tidak pernah mendidik putra-putrinya dengan pendidikan keras dan tidak dengan membebaskan anak-anaknya, tetapi beliau dalam mendidik keluarganya terutama kepada anak-anaknya adalah dengan limpahan kasih sayang yang amat besar. Senada dengan yang dikatakan oleh sahabat Anas ra. yaitu &ldquo;aku tidak mendapatkan seseorang yang kasih sayangnya pada keluarganya melebihi Rasulullah SAW.&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Seorang muslim sepatutunya mencontoh teladan yang telah diberikan Rasul SAW, dalam memuliakan putra putrinya. Beliau dalam mendidik anak-anaknya melalui ajaran wahyu Ilahi yaitu dengan penuh kasih sayang terhadap anak-anaknya. Dengan pemberian kasih sayang tersebut, diharapkan dapat menunjang pertumbuhan dan perkembangan anak. Sebab anak merupakan aset masa depan. Sebagai orang tua dapat meneladani ajaran-ajaran Rasul SAW tersebut, melalui para pemikir dan pemerhati pendidikan (anak) dalam Islam. Salah satu pemerhati pendidikan (anak) dalam Islam yang memberikan gambaran yang benar sesuai dengan ajaran Islam adalah Ulwan. Ia memberikan pandangannya dalam mendidik anak dalam keluarga melalui metode-metode yang harus diterapkan dalam pendidikan anak termasuk dalam hal pendidikan moral. Apabila metode-metode tersebut diterapkan, niscaya apa yang menjadi harapan bersama sebagai muslimin yaitu tumbuhnya para generasi Islam yang tangguh dan sebagai penebar kebenaran, dapat direalisasikan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Untuk mmemperoleh hasil yang baik dalam pelaksanaan pendidikan (moral) maka harus memenuhi beberapa faktor-faktornya. Salah satu faktornya adalah metode. Metode merupakan sarana untuk menyampaikan isi atau materi pendidikan tersebut, agar tujuan yang diharapkan dapat tercapai dengan hasil yang baik.</p>\r\n\r\n<p>Diantara metode pendidikan moral anak dalam keluarga yang ditawarkan oleh Abdullah Nashih Ulwan adalah :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Pendidikan dengan keteladanan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Menurut al-Ghazali anak adalah amanat bagi orang tuanya. Hatinya yang suci merupakan permata tak ternilai harganya, masih murni dan belum terbentuk. Orang tuanya merupakan arsitek atau pengukir kepribadian anaknya. Sebelum mendidik orang lain, sebaiknya orang tua harus mendidik pada dirinya terlebih dahulu. Sebab anak merupakan peniru ulung. Segala informasi yang masuk pada diri anak, baik melalui penglihatan dan pendengaran dari orang di sekitarnya, termasuk orang tua akan membentuk karakter anak tersebut. Apalagi anak yang berumur sekitar 3-6 tahun, ia senantiasa melakukan imitasi terhadap orang yang ia kagumi (ayah dan ibunya). Rasa imitasi dari anak yang begitu besar, sebaiknya membuat orang tua harus ekstra hati-hati dalam bertingkah laku, apalagi didepan anak-anaknya. Sekali orang tua ketahuan berbuat salah dihadapan anak, jangan berharap anak akan menurut apa yang diperintahkan. Oleh karena itu sudah sepantasnya bagi orang tua pemegang amanat, untuk memberikan teladan yang baik kepada putra putrinya dalam kehidupan berkeluarga. Keluarga merupakan sekolah pertama bagi anak. Orang tua terutama ibu merupakan pendidik pertama dan utama bagi anak dalam membentuk pribadinya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ibu mempengaruhi anak melalui sifatnya yang menghangatkan, menumbuhkan rasa diterima, dan menanamkan rasa aman pada diri anak. Sedangkan ayah mempengaruhi anaknya melalui sifatnya yang mengembangkan kepribadian, menanamkan disiplin, memberikan arah dan dorongan serta bimbingan agar anak tambah berani dalam menghadapi kehidupan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Teladan yang baik dari orang tua kepada anak (sekitar umur 6 tahun) akan berpengaruh besar kepada perkembangan anak di masa mendatang. Sebab kebaikan di waktu kanak-kanak awal menjadi dasar untuk pengembangan di masa dewasa kelak. Untuk itu lingkungan keluarga harus sebanyak mungkin memberikan keteladanan bagi anak. Dengan keteladanan akan memudahkan anak untuk menirunya. Sebab keteladanan lebih cepat mempengaruhi tingkah laku anak. Apa yang dilihatnya akan ia tirukan dan lama kelamaan akan menjadi tradisi bagi anak. Hal ini sesuai firman Allah SWT QS. al-Ahzab ( 33) : 21.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Sesungguhnya telah ada pada (diri) Rasulullah itu suri teladan yang baik bagimu (yaitu) bagi orang yang mengharap (rahmat) Allah dan (kedatangan) hari kiamat dan dia banyak menyebut Allah.&rdquo; (QS. Al-Ahzab : 21)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam hal keteladanan ini, lebih jauh Abdullah Nashih Ulwan menafsirkan dalam beberapa bentuk, yaitu :</p>\r\n\r\n<p>a. Keteladanan dalam ibadah.</p>\r\n\r\n<p>b. Keteladanan bermurah hati.</p>\r\n\r\n<p>c. Keteladanan kerendahan hati.</p>\r\n\r\n<p>d. Keteladanan kesantunan.</p>\r\n\r\n<p>e. Keteladanan keberanian.</p>\r\n\r\n<p>f. Keteladanan memegang akidah</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Karena obyeknya anak (kanak-kanak) tentunya bagi orang tua dalam memberikan teladan harus sesuai dengan perkembangannya sehingga anak mudah mencerna apa yang disampaikan oleh bapak ibunya. Sebagai contoh agar anak membiasakan diri dengan ucapan &ldquo;salam&rdquo;, maka senantiasa orang tua harus memberikan ajaran tersebut setiap hari yaitu hendak pergi dan pulang ke rumah (keteladanan kerendahan hati). Yang penting bagi orang tua tampil dihadapan anak sesuai dengan ajaran-ajaran Islam, niscaya semua itu akan ditirunya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Pendidikan dengan adat kebiasaan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Setiap manusia yang dilahirkan membawa potensi, salah satunya berupa potensi beragama. Potensi beragama ini dapat terbentuk pada diri anak (manusia) melalui 2 faktor, yaitu : faktor pendidikan Islam yang utama dan faktor pendidikan lingkungan yang baik. Faktor pendidikan Islam yang bertanggung jawab penuh adalah bapak ibunya. Ia merupakan pembentuk karakter anak. Hal ini sesuai dengan sabda Rasul SAW yang diriwayatkan oleh Muslim dan Abu Hurairah.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Dari Abi hurairah ra. telah bersabda Rasulullah SAW. tidak ada anak yang dilahirkan, kecuali dalam keadaan fitrah. Maka kedua orang tuanyalah yang akan menjadikannya sebagai orang yahudi, nasrani, atau majusi&rdquo;. (HR. Muslim)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Setelah anak diberikan masalah pengajaran agama sebagai sarana teoritis dari orang tuanya, maka faktor lingkungan harus menunjang terhadap pengajaran tersebut, yakni orang tua senantiasa memberikan aplikasi pembiasaan ajaran agama dalam lingkungan keluarganya. Sebab pembiasaan merupakan upaya praktis dan pembentukan (pembinaan) dan persiapan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pada umur kanak-kanak kecenderungannya adalah meniru apa yang dilakukan oleh orang-orang disekitarnya, baik saudara famili terdekatnya ataupun bapak ibunya. Oleh karena itu patut menjadi perhatian semua pihak, terutama orang tuanya selaku figur yang terbaik di mata anaknya. Jika orang tua menginginkan putra putrinya tumbuh dengan menyandang kebiasaan-kebiasaan yang baik dan akhlak terpuji serta kepribadian yang sesuai ajaran Islam, maka orang tua harus mendidiknya sedini mungkin dengan moral yang baik. Karena tiada yang lebih utama dari pemberian orang tua kecuali budi pekerti yang baik. Hal ini sesuai dengan sabda Rasul SAW yang diriwayatkan al-Tirmidzi dari Ayyub bin Musa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Diceritakan dari Ayyub bin Musa dari ayahnya dari kakeknya, bahwa Rasulullah saw bersabda : Tidak ada pemberian yang lebih utama dari seorang ayah kepada anaknya kecuali budi pekerti yang baik&rdquo;. (H.R At-Tirmidzi)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila anak dalam lahan yang baik (keluarganya) memperoleh bimbingan, arahan, dan adanya saling menyayangi antar anggota keluarga, niscaya lambat laun anak akan terpengaruh informasi yang ia lihat dan ia dengar dari semua perilaku orang&ndash; orang disekitarnya. Dan pengawasan dari orang tua sangat diperlukan sebagai kontrol atas kekeliruan dari perilaku anak yang tak sesuai dengan ajaran Islam.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. Pendidikan dengan Nasihat</p>\r\n\r\n<p>Pemberi nasihat seharusnya orang yang berwibawa di mata anak. Dan pemberi nasihat dalam keluarga tentunya orang tuanya sendiri selaku pendidik bagi anak. Anak akan mendengarkan nasihat tersebut, apabila pemberi nasihat juga bisa memberi keteladanan. Sebab nasihat saja tidak cukup bila tidak diikuti dengan keteladanan yang baik.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Anak tidak akan melaksanakan nasihat tersebut apabila didapatinya pemberi nasihat tersebut juga tidak melaksanakannya. Anak tidak butuh segi teoritis saja, tapi segi praktislah yang akan mampu memberikan pengaruh bagi diri anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nasihat yang berpengaruh, membuka jalannya ke dalam jiwa secara langsung melalui perasaan. Setiap manusia (anak) selalu membutuhkan nasihat, sebab dalam jiwa terdapat pembawaan itu biasanya tidak tetap, dan oleh karena itu kata&ndash;kata atau nasihat harus diulang&ndash;ulang. Nasihat akan berhasil atau mempengaruhi jiwa anak, tatkala orangtua mampu memberikan keadaan yang baik. Hal ini sesuai dengan firman Allah SWT dalam QS. al-Baqarah ( 2) : 44.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Mengapa kamu suruh orang lain (mengerjakan) kabaktian, sedang kamu melupakan diri (kewajiban) mu sendiri, Padahal kamu membaca al-Kitab (Taurat) ? maka tidakkah kamu berpikir ? (Q.S al-Baqarah : 44)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Agar harapan orang tua terpenuhi yakni anak mengikuti apa&ndash; apa yang telah diperintahkan dan yang telah diajarkannya, tentunya disamping memberikan nasihat yang baik juga ditunjang dengan teladan yang baik pula. Karena pembawaan anak mudah terpengaruh oleh kata&ndash;kata yang didengarnya dan juga tingkah aku yang sering dilihatnya dalam kehidupan sehari&ndash;hari dari pagi hari sampai sore hari.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nasihat juga harus diberikan sesering mungkin kepada anak&ndash;anak masa sekolah dasar, sebab anak sudah bersosial dengan teman sebayanya. Agar apa&ndash;apa yang telah diberikan dalam keluarganya tidak mudah luntur atau tepengaruh dengan lingkungan barunya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Penyajian atau memberikan nasihat itu ada pembagiannya, yaitu :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>a. Menyeru untuk memberikan kepuasan dengan kelembutan atau penolakan.</p>\r\n\r\n<p>Sebagai contohnya adalah seruan Lukman kepada anak&ndash;anaknya, agar tidak mempersekutukan Allah SWT. Q.S. Lukman (31) :13.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Dan (ingatlah) ketika Luqman berkata kepada anaknya, di waktu ia memberi pelajaran kepadanya : &ldquo;Hai anakku, janganlah kamu mempersekutukan Allah, Sesungguhnya mempersekutukan (Allah) adalah benar&ndash;benar kezaliman yang besar.&rdquo; (Q.S Luqman : 13).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>b. Metode cerita dengan disertai tamsil ibarat dan nasihat</p>\r\n\r\n<p>Metode ini mempunyai pengaruh terhadap jiwa dan akal. Biasanya anak itu menyenangi tentang cerita-cerita. Untuk itu orang tua sebisa mungkin untuk memberikan masalah cerita yang berkaitan dengan keteladanan yang baik yang dapat menyentuh perasaannya.Sebagaimana firman-Nya dalam QS. al-A`raf (7) : 176.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;&hellip; Maka ceritakanlah (kepada mereka) kisah-kisah itu agar mereka berpikir&rdquo;.[24]</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>c. Pengarahan melalui wasiat</p>\r\n\r\n<p>Orang tua yang bertanggung jawab tentunya akan berusaha menjaga amanat-Nya dengan memberikan yang terbaik buat anak demi masa depannya dan demi keselamatannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. Pendidikan dengan Perhatian</p>\r\n\r\n<p>Sebagai orangtua berkewajiban untuk memenuhi kebutuhan&ndash;kebutuhan anaknya, baik kebutuhan jasmani ataupun kebutuhan yang berbentuk rohani. Diantara kebutuhan anak yang bersifat rohani adalah anak ingin diperhatikan dalam perkembangan dan pertumbuhannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pendidikan dengan perhatian adalah mencurahkan, memperhatikan dan senantiasa mengikuti perkembangan anak dalam pembinaan akidah dan moral, persiapan spiritual dan sosial, disamping selalu bertanya tentang situasi pendidikan jasmani dan daya hasil ilmiahnya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Orang tua yang bijaksana tentunya mengetahui perkembangan-perkembangan anaknya. Dan ibu adalah pembentuk pribadi putra putrinya lebih besar prosentasenya dibanding seorang ayah. Tiap hari waktu Ibu banyak bersama dengan anak, sehingga wajar bila kecenderungan anak lebih dekat dengan para ibunya. Untuk itu ibu diharapkan mampu berkiprah dalam mempersiapkan pertumbuhan dan perkembangan putra-putrinya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Orang tua yang baik senantiasa akan mengoreksi perilaku anaknya yang tidak baik dengan perasaan kasih sayangnya, sesuai dengan perkembangan usia anaknya. Sebab pengasuhan yang baik akan menanamkan rasa optimisme, kepercayaan, dan harapan anak dalam hidupnya. Dalam memberi perhatian ini, hendaknya orang tua bersikap selayak mungkin, tidak terlalu berlebihan dan juga tidak terlalu kurang. Namun perhatian orang tua disesuaikan dengan perkembangan dan pertumbuhan anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila orang tua mampu bersikap penuh kasih sayang dengan memberikan perhatian yang cukup, niscaya anak-anak akan menerima pendidikan dari orang tuanya dengan penuh perhatian juga. Namun pangkal dari seluruh perhatian yang utama adalah perhatian dalam akidah.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. Pendidikan dengan memberikan hukuman</p>\r\n\r\n<p>Hukuman diberikan, apabila metode-metode yang lain sudah tidak dapat merubah tingkah laku anak, atau dengan kata lain cara hukuman merupakan jalan terakhir yang ditempuh oleh pendidik, apabila ada perilaku anak yang tidak sesuai dengan ajaran Islam. Sebab hukuman merupakan tindakan tegas untuk mengembalikan persoalan di tempat yang benar. Hukuman sesungguhnya tidaklah mutlak diberikan. Karena ada orang dengan teladan dan nasehat saja sudah cukup, tidak memerlukan hukuman. Tetapi pribadi manusia tidak sama seluruhnya. Sebenarnya tidak ada pendidik yang tidak sayang kepada siswanya. Demikian juga tidak ada orang tua yang merasa senang melihat penderitaan anaknya. Dengan memberikan hukuman, orang tua sebenarnya merasa kasihan terhadap anaknya yang tidak mau melaksanakan ajaran Islam. Karena salah satu fungsi dari hukuman adalah mendidik. Sebelum anak mengerti peraturan, ia dapat belajar bahwa tindakan tertentu benar apabila tidak menerima hukuman dan tindakan lainnya salah apabila mendapatkan suatu hukuman.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam memberikan hukuman ini diharapkan orang tua melihat ruang waktu dan tempatnya. Diantara metode memberikan hukuman kepada anak adalah :</p>\r\n\r\n<p>a. Menghukum anak dengan lemah lembut dan kasih sayang.</p>\r\n\r\n<p>b. Menjaga tabiat anak yang salah.</p>\r\n\r\n<p>c. Hukuman diberikan sebagai upaya perbaikan terhadap diri anak, dengan tahapan yang paling akhir dari metode-metode yang lain.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Memberi hukuman pada anak, seharusnya para orang tua sebisa mungkin menahan emosi untuk tidak memberi hukuman berbentuk badaniah. Kalau hukuman yang berbentuk psikologis sudah mampu merubah sikap anak, tentunya tidak dibutuhkan lagi hukuman yang menyakitkan anak tersebut. Hukuman bentuknya ada dua, yakni hukuman psikologis dan hukuman biologis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bentuk hukuman yang bersifat psikologis adalah :</p>\r\n\r\n<p>a. Menunjukkan kesalahan dengan pengarahan.</p>\r\n\r\n<p>b. Menunjukkan kesalahan dengan memberikan isyarat.</p>\r\n\r\n<p>c. Menunjukkan kesalahan dengan kecaman.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hukuman bentuk psikologis ini diberikan kepada anak dibawah umur 10 tahun. Apabila hukuman psikologis tidak mampu merubah perilaku anak, maka hukuman biologis lah yang dijatuhkan tatkala anak sampai umur 10 tahun tidak ada perubahan pada sikapnya. Hal ini dilakukan supaya anak jera dan tidak meneruskan perilakunya yang buruk. Sesuai sabda Rasul SAW yang diriwayatkan Abu Daud dari Mukmal bin Hisyam.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Suruhlah anak kalian mengerjakan shalat, sedang mereka berumur tujuh tahun, dan pukulilah mereka itu karena shalat ini, sedang mereka berumut sepuluh tahun, dan pisahkanlah tempat tidur mereka&rdquo;. (HR. Abu Daud)RESENSI BUKU TARBIYATUL AULAD ABDULLAH NASHIH ULWAN</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kitab &ldquo;Tarbiyatul Aulad Fil Islam&rdquo; memiliki karakteristik tersendiri. Keunikan karakteristik itu terletak pada uraiannya yang menggambarkan totalitas dan keutamaan Islam. Islam sebagai agama yang tertinggi dan tidak ada yang melebihi ketinggiannya adalah menjadi obsesi Ulwan dalam setiap analisa dan argumentasinya, sehingga tidak ada satu bagian pun dalam kitab tersebut yang uraiannya tidak didasarkan atas dasar-dasar dan kaidah-kaidah nash.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kitab ini disusun dalam tiga bagian atau &ldquo;qism&rdquo; yang kronologis, masing-masing bagian memuat beberapa pasal dan setiap pasal mengandung beberapa topik pembahasan. Judul-judul dan pasal-pasal dalam setiap bagian itu akan tersusun sebagai berikut ini :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian pertama terdiri dari empat pasal, yaitu:</p>\r\n\r\n<p>a. Pasal pertama adalah perkawinan teladan dalam kaitannya dengan pendidikan.</p>\r\n\r\n<p>b. Pasal kedua adalah perasaan psikologis terhadap anak-anak.</p>\r\n\r\n<p>c. Pasal ketiga adalah hukum umum dalam hubungannya dengan anak yang lahir.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pasal ini terdiri dari empat bahasan :</p>\r\n\r\n<p>1. Pertama , adalah yang dilakukan oleh pendidik ketika lahir.</p>\r\n\r\n<p>2. Kedua , yaitu penamaan anak dan hukumnya.</p>\r\n\r\n<p>3. Ketiga , adalah aqiqah anak dan hukumnya.</p>\r\n\r\n<p>4. Keempat , adalah menyunatkan anak dan hukumnya.</p>\r\n\r\n<p>d. Pasal keempat adalah sebab-sebab kelainan pada anak dan penanggulangannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian kedua yaitu tanggung jawab terbesar bagi para pendidik, bagian ini terdiri dari tujuh pasal adalah sebagai berikut :</p>\r\n\r\n<p>a. Pasal pertama adalah tanggung jawab pendidikan Iman.</p>\r\n\r\n<p>b. Pasal kedua adalah tanggung jawab pendidikan moral.</p>\r\n\r\n<p>c. Pasal ketiga adalah tanggung jawab pendidikan fisik</p>\r\n\r\n<p>d. Pasal keempat adalah tanggung jawab pendidikan intelektual.</p>\r\n\r\n<p>e. Pasal kelima adalah tanggung jawab pendidikan psikologis.</p>\r\n\r\n<p>f. Pasal keenam adalah tanggung jawab pendidikan sosial.</p>\r\n\r\n<p>g. Pasal ketujuh adalah tanggung jawab pendidikan seksual.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian ketiga terdiri dari tiga pasal dan penutup :</p>\r\n\r\n<p>a. Pasal pertama adalah faktor-faktor pendidikan yang berpengaruh.</p>\r\n\r\n<p>b. Pasal kedua adalah dasar-dasar fundamental dalam mendidik anak.</p>\r\n\r\n<p>c. Pasal ketiga berisi saran-saran paedagogis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bagian pertama sampai dengan bagian ketiga tersebut, terdapat dalam jilid I. Sedangkan dalam jilid II, meliputi tiga pasal, yaitu :</p>\r\n\r\n<p>a. Pasal pertama adalah metode pendidikan yang influentif terhadap anak.</p>\r\n\r\n<p>b. Pasal kedua adalah kaidah-kaidah elementer dalam pendidikan anak.</p>\r\n\r\n<p>c. Pasal ketiga adalah gagasan edukatif yang sangat esensial.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Fokus kajian skripsi ini terdapat dalam jilid II pasal pertama yang berisi tentang metode pendidikan yang influentif terhadap anak pada halaman dua dan seterusnya. Ulwan memaparkan 5 metode mendidik moral anak dalam keluarga. Diantara metode-metode pendidikan moral anak dalam keluarga adalah :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pendidikan dengan keteladanan.</p>\r\n\r\n<p>Pendidikan dengan adat kebiasaan.</p>\r\n\r\n<p>Pendidikan dengan nasihat.</p>\r\n\r\n<p>Pendidikan dengan memberikan perhatian.</p>\r\n\r\n<p>Pendidikan dengan memberikan hukuman.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila metode-metode tersebut diterapkan dalam pendidikan anak khususnya dalam keluarga, maka secara bertahap mereka para orang tua mempersiapkan anak-anaknya untuk menjadi anggota masyarakat yang berguna bagi kehidupan dan pasukan-pasukan yang kuat untuk kepentingan Islam (sebagai penegak ajaran-ajaran Islam dalam kehidupan).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C. Metode Pendidikan Moral Anak dalam Keluarga menurut Abdullah Nashih Ulwan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sarana untuk membentuk keluarga dalam Islam harus melalui ikatan pernikahan. Dengan melangsungkan pernikahan, maka pasangan suami istri akan memperoleh manfaat dari pernikahan tersebut. Salah satu manfaatnya adalah memelihara kelangsungan jenis manusia di dunia yang fana ini. Kelahiran anak merupakan amanat dari Allah SWT kepada bapak dan ibu sebagai pemegang amanat yang harusnya dijaga, dirawat, dan diberikan pendidikan. Itu semua merupakan bagian dari tanggung jawab orang tua kepada anaknya.</p>\r\n\r\n<p>Anak dilahirkan tidak dalam keadan lengkap dan tidak pula dalam keadaan kosong. Ia dilahirkan dalam keadaan fitrah. Memang ia dilahirkan dalam keadaan tidak tahu apa-apa, akan tetapi anak telah dibekali dengan pendengaran, penglihatan, dan kata hati.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dengan diberikannya penglihatan, pendengaran, dan kata hati tersebut, diharapkan orang tua harus mampu membimbing, mengarahkan, dan mendidiknya dengan ekstra hati-hati karena anak sebagai peniru yang ulung. Oleh karena itu semaksimal mungkin orang tua memberikan pelayanan terhadap anaknya. Pelayanan yang maksimal akan menghasilkan suatu harapan bagi bapak ibunya, tiada lain suatu kebahagiaan hasil jerih payahnya. Sebab anak adalah sumber kebahagiaan, kesenangan, dan sebagai harapan dimasa yang akan datang.[8] Harapan-harapan orang tua akan terwujud, tatkala mereka mempersiapkan sedini mungkin pendidikan yang baik sebagai sarana pertumbuhan dan perkembangan bagi anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Memang diakui bahwa mengemudikan bahtera rumah tangga yang baik, yang sakinah, dan yang maslahah merupakan tugas kewajiban yang sangat rumit, tidak kalah rumitnya dengan mengelola sebuah pabrik, dan tidak kalah canggihnya dengan mengemudikan pesawat terbang karena orang tua harus siap untuk memperpadukan sekian banyak unsur dan dimensi mulai dari dimensi sikap mental, ilmu pengetahuan, ketrampilan dan lain sebagainya. Sebagai kewajiban dari orang tua, dalam hal ini adalah pemegang amanat, maka barang siapa yang mampu menjaga amanat tersebut akan diberi pahala, dan sebaliknya. Hal ini sesuai dengan janji Allah SWT dalam firmanya, QS.al-Kahfi (18) : 46.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Harta dan anak-anak adalah perhiasan kehidupan dunia, tetapi amalan-amalan yang kekal lagi saleh adalah lebih baik pahala disisi Tuhanmu serta lebih baik untuk menjadi harapan&rdquo;. (QS. Al-Kahfi : 46)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam mendidik anak, tentunya harus ada kesepakatan antara bapak ibu sebagai orang tua, akan dibawa kepada pendidikan yang otoriter atau pendidikan yang demokratis atau bahkan yang liberal, sebab mereka penentu pelaksana dalam keluarga.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam kehidupan masyarakat terkecil, yaitu keluarga, suami secara fungsional adalah penanggung jawab utama rumah tangga (keluarga) sedangkan istri adalah mitra setia yang aktif konstruktif mengelola rumah tangga. Operasionalisasi kehidupan berkeluarga sebaiknya dilakukan berdasarkan amar makruf nahi munkar.</p>\r\n\r\n<p>Salah satu wujud amar makruf nahi munkar dalam kehidupan berkeluarga adalah memberikan pendidikan kepada putra putrinya berdasarkan ajaran Islam. Antara keluarga satu dengan keluarga lainnya mempunyai prinsip dan sistem sendiri-sendiri dalam mendidik anaknya. Namun orang tua jangan terbuai atau melupakan terhadap ajaran-ajaran Islam, terutama dalam hal pendidikan anak sebagaimana yang telah dicontohkan Rasul saw. sebagai pembawa panji-panji Islam, Rasul SAW tidak pernah mendidik putra-putrinya dengan pendidikan keras dan tidak dengan membebaskan anak-anaknya, tetapi beliau dalam mendidik keluarganya terutama kepada anak-anaknya adalah dengan limpahan kasih sayang yang amat besar. Senada dengan yang dikatakan oleh sahabat Anas ra. yaitu &ldquo;aku tidak mendapatkan seseorang yang kasih sayangnya pada keluarganya melebihi Rasulullah SAW.&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Seorang muslim sepatutunya mencontoh teladan yang telah diberikan Rasul SAW, dalam memuliakan putra putrinya. Beliau dalam mendidik anak-anaknya melalui ajaran wahyu Ilahi yaitu dengan penuh kasih sayang terhadap anak-anaknya. Dengan pemberian kasih sayang tersebut, diharapkan dapat menunjang pertumbuhan dan perkembangan anak. Sebab anak merupakan aset masa depan. Sebagai orang tua dapat meneladani ajaran-ajaran Rasul SAW tersebut, melalui para pemikir dan pemerhati pendidikan (anak) dalam Islam. Salah satu pemerhati pendidikan (anak) dalam Islam yang memberikan gambaran yang benar sesuai dengan ajaran Islam adalah Ulwan. Ia memberikan pandangannya dalam mendidik anak dalam keluarga melalui metode-metode yang harus diterapkan dalam pendidikan anak termasuk dalam hal pendidikan moral. Apabila metode-metode tersebut diterapkan, niscaya apa yang menjadi harapan bersama sebagai muslimin yaitu tumbuhnya para generasi Islam yang tangguh dan sebagai penebar kebenaran, dapat direalisasikan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Untuk mmemperoleh hasil yang baik dalam pelaksanaan pendidikan (moral) maka harus memenuhi beberapa faktor-faktornya. Salah satu faktornya adalah metode. Metode merupakan sarana untuk menyampaikan isi atau materi pendidikan tersebut, agar tujuan yang diharapkan dapat tercapai dengan hasil yang baik.</p>\r\n\r\n<p>Diantara metode pendidikan moral anak dalam keluarga yang ditawarkan oleh Abdullah Nashih Ulwan adalah :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Pendidikan dengan keteladanan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Menurut al-Ghazali anak adalah amanat bagi orang tuanya. Hatinya yang suci merupakan permata tak ternilai harganya, masih murni dan belum terbentuk. Orang tuanya merupakan arsitek atau pengukir kepribadian anaknya. Sebelum mendidik orang lain, sebaiknya orang tua harus mendidik pada dirinya terlebih dahulu. Sebab anak merupakan peniru ulung. Segala informasi yang masuk pada diri anak, baik melalui penglihatan dan pendengaran dari orang di sekitarnya, termasuk orang tua akan membentuk karakter anak tersebut. Apalagi anak yang berumur sekitar 3-6 tahun, ia senantiasa melakukan imitasi terhadap orang yang ia kagumi (ayah dan ibunya). Rasa imitasi dari anak yang begitu besar, sebaiknya membuat orang tua harus ekstra hati-hati dalam bertingkah laku, apalagi didepan anak-anaknya. Sekali orang tua ketahuan berbuat salah dihadapan anak, jangan berharap anak akan menurut apa yang diperintahkan. Oleh karena itu sudah sepantasnya bagi orang tua pemegang amanat, untuk memberikan teladan yang baik kepada putra putrinya dalam kehidupan berkeluarga. Keluarga merupakan sekolah pertama bagi anak. Orang tua terutama ibu merupakan pendidik pertama dan utama bagi anak dalam membentuk pribadinya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ibu mempengaruhi anak melalui sifatnya yang menghangatkan, menumbuhkan rasa diterima, dan menanamkan rasa aman pada diri anak. Sedangkan ayah mempengaruhi anaknya melalui sifatnya yang mengembangkan kepribadian, menanamkan disiplin, memberikan arah dan dorongan serta bimbingan agar anak tambah berani dalam menghadapi kehidupan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Teladan yang baik dari orang tua kepada anak (sekitar umur 6 tahun) akan berpengaruh besar kepada perkembangan anak di masa mendatang. Sebab kebaikan di waktu kanak-kanak awal menjadi dasar untuk pengembangan di masa dewasa kelak. Untuk itu lingkungan keluarga harus sebanyak mungkin memberikan keteladanan bagi anak. Dengan keteladanan akan memudahkan anak untuk menirunya. Sebab keteladanan lebih cepat mempengaruhi tingkah laku anak. Apa yang dilihatnya akan ia tirukan dan lama kelamaan akan menjadi tradisi bagi anak. Hal ini sesuai firman Allah SWT QS. al-Ahzab ( 33) : 21.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Sesungguhnya telah ada pada (diri) Rasulullah itu suri teladan yang baik bagimu (yaitu) bagi orang yang mengharap (rahmat) Allah dan (kedatangan) hari kiamat dan dia banyak menyebut Allah.&rdquo; (QS. Al-Ahzab : 21)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam hal keteladanan ini, lebih jauh Abdullah Nashih Ulwan menafsirkan dalam beberapa bentuk, yaitu :</p>\r\n\r\n<p>a. Keteladanan dalam ibadah.</p>\r\n\r\n<p>b. Keteladanan bermurah hati.</p>\r\n\r\n<p>c. Keteladanan kerendahan hati.</p>\r\n\r\n<p>d. Keteladanan kesantunan.</p>\r\n\r\n<p>e. Keteladanan keberanian.</p>\r\n\r\n<p>f. Keteladanan memegang akidah</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Karena obyeknya anak (kanak-kanak) tentunya bagi orang tua dalam memberikan teladan harus sesuai dengan perkembangannya sehingga anak mudah mencerna apa yang disampaikan oleh bapak ibunya. Sebagai contoh agar anak membiasakan diri dengan ucapan &ldquo;salam&rdquo;, maka senantiasa orang tua harus memberikan ajaran tersebut setiap hari yaitu hendak pergi dan pulang ke rumah (keteladanan kerendahan hati). Yang penting bagi orang tua tampil dihadapan anak sesuai dengan ajaran-ajaran Islam, niscaya semua itu akan ditirunya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Pendidikan dengan adat kebiasaan</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Setiap manusia yang dilahirkan membawa potensi, salah satunya berupa potensi beragama. Potensi beragama ini dapat terbentuk pada diri anak (manusia) melalui 2 faktor, yaitu : faktor pendidikan Islam yang utama dan faktor pendidikan lingkungan yang baik. Faktor pendidikan Islam yang bertanggung jawab penuh adalah bapak ibunya. Ia merupakan pembentuk karakter anak. Hal ini sesuai dengan sabda Rasul SAW yang diriwayatkan oleh Muslim dan Abu Hurairah.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Dari Abi hurairah ra. telah bersabda Rasulullah SAW. tidak ada anak yang dilahirkan, kecuali dalam keadaan fitrah. Maka kedua orang tuanyalah yang akan menjadikannya sebagai orang yahudi, nasrani, atau majusi&rdquo;. (HR. Muslim)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Setelah anak diberikan masalah pengajaran agama sebagai sarana teoritis dari orang tuanya, maka faktor lingkungan harus menunjang terhadap pengajaran tersebut, yakni orang tua senantiasa memberikan aplikasi pembiasaan ajaran agama dalam lingkungan keluarganya. Sebab pembiasaan merupakan upaya praktis dan pembentukan (pembinaan) dan persiapan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pada umur kanak-kanak kecenderungannya adalah meniru apa yang dilakukan oleh orang-orang disekitarnya, baik saudara famili terdekatnya ataupun bapak ibunya. Oleh karena itu patut menjadi perhatian semua pihak, terutama orang tuanya selaku figur yang terbaik di mata anaknya. Jika orang tua menginginkan putra putrinya tumbuh dengan menyandang kebiasaan-kebiasaan yang baik dan akhlak terpuji serta kepribadian yang sesuai ajaran Islam, maka orang tua harus mendidiknya sedini mungkin dengan moral yang baik. Karena tiada yang lebih utama dari pemberian orang tua kecuali budi pekerti yang baik. Hal ini sesuai dengan sabda Rasul SAW yang diriwayatkan al-Tirmidzi dari Ayyub bin Musa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Diceritakan dari Ayyub bin Musa dari ayahnya dari kakeknya, bahwa Rasulullah saw bersabda : Tidak ada pemberian yang lebih utama dari seorang ayah kepada anaknya kecuali budi pekerti yang baik&rdquo;. (H.R At-Tirmidzi)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apabila anak dalam lahan yang baik (keluarganya) memperoleh bimbingan, arahan, dan adanya saling menyayangi antar anggota keluarga, niscaya lambat laun anak akan terpengaruh informasi yang ia lihat dan ia dengar dari semua perilaku orang&ndash; orang disekitarnya. Dan pengawasan dari orang tua sangat diperlukan sebagai kontrol atas kekeliruan dari perilaku anak yang tak sesuai dengan ajaran Islam.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. Pendidikan dengan Nasihat</p>\r\n\r\n<p>Pemberi nasihat seharusnya orang yang berwibawa di mata anak. Dan pemberi nasihat dalam keluarga tentunya orang tuanya sendiri selaku pendidik bagi anak. Anak akan mendengarkan nasihat tersebut, apabila pemberi nasihat juga bisa memberi keteladanan. Sebab nasihat saja tidak cukup bila tidak diikuti dengan keteladanan yang baik.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Anak tidak akan melaksanakan nasihat tersebut apabila didapatinya pemberi nasihat tersebut juga tidak melaksanakannya. Anak tidak butuh segi teoritis saja, tapi segi praktislah yang akan mampu memberikan pengaruh bagi diri anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nasihat yang berpengaruh, membuka jalannya ke dalam jiwa secara langsung melalui perasaan. Setiap manusia (anak) selalu membutuhkan nasihat, sebab dalam jiwa terdapat pembawaan itu biasanya tidak tetap, dan oleh karena itu kata&ndash;kata atau nasihat harus diulang&ndash;ulang. Nasihat akan berhasil atau mempengaruhi jiwa anak, tatkala orangtua mampu memberikan keadaan yang baik. Hal ini sesuai dengan firman Allah SWT dalam QS. al-Baqarah ( 2) : 44.</p>\r\n', '2022-11-21 15:52:35', 1, 'Pendaftaran', 78, 'cf989599b9a33f1e3c0d4f161f1261bd.jpg', 1, 'Admin Santri', 0, 'resensi-buku-tarbiyatul-aulad-abdullah-nashih-ulwan', NULL, NULL, '');
