(185, 'Prestasi Yang Diraih pada Tahun 2018	', '<p><strong>SMP</strong></p>\r\n\r\n<p><strong>1. Juara 2 Story Telling tingkat Provinsi</strong><strong>2. Juara Harapan 2 Kaligrafi tingkat Provinsi</strong><strong>3. Juara 2 Speech Contest Action 6 se-Priangan Timur</strong><strong>4. The Best Biology LCT MIPA Al-Amin se-Priangan Timur</strong><strong>5. The Best Penjawab soal HOTS Fisika LCT MIPA Al-Amin</strong><br />\r\n<strong>SMA</strong><strong>1. Juara 1 Lomba Tahfidz Juz 30</strong><strong>2. Juara 3 Parahyangan Taekwondo Championship</strong><strong>3. Juara 1 under 59 kg Martha Taekwondo Championship</strong><strong>4. Juara 2 under 42 kg Taekwondo O2SN Kota Tasikmalaya</strong><strong>5. Juara 3 under 46 kg Taekwondo O2SN Kota Tasikmalaya</strong><strong>6. Juara 3 under 49 kg Taekwondo O2SN Kota Tasikmalaya</strong></p>\r\n\r\n<p><strong>7. Juara 3 under 49 Takwondo Dandim Championship</strong></p>\r\n', '2022-11-21 16:04:43', 6, 'Prestasi', 76, '64cc3eb9128a31c7f445d25645639364.jpg', 1, 'Admin Santri', 0, 'prestasi-yang-diraih-pada-tahun-2018', NULL, NULL, ''),
(187, 'Alur Pendaftaran Santriwati Baru	', '', '2022-11-21 16:07:30', 1, 'Pendaftaran', 72, '17ca1d7375d0cceaba04362283667b4c.jpeg', 1, 'Admin Santri', 0, 'alur-pendaftaran-santriwati-baru', NULL, NULL, ''),
(188, 'Kreativitas Santriwati dalam Memasak	', '<p>Pondok Pesantren Ishlahul Ummah, Tasikmalaya. Terkadang, dalam proses pembelajaran, siswa merasa jenuh dengan materi dan suasana kelas yang itu-itu saja. Oleh karena itu, guru dituntut untuk lebih kreatif dalam membuat suasana belajar lebih nyaman agar siswa mampu menyerap seluruh materi yang diajarkan. Salah satu cara yang bisa dilakukan adalah mengubah suasana belajar, seperti belajar di luar kelas.<br />\r\n<br />\r\nSeperti yang dilakukan oleh para pengajar di Pondok Pesantren Ishlahul Ummah, guru berinisiatif melakukan sebuah pembelajaran yang dilakukan diluar kelas yang akhirnya dibuat menjadi sebuah program, yaitu program keputrian. Program keputrian merupakan sarana atau wadah berkumpulnya muslimah untuk menambah ilmu, keterampilan dan pemahaman mengenai kemuslimahan. Di Ishlahul Ummah sendiri saat ini ada 3 jenis keterampilan yang diajarkan, yaitu memasak, menyulam, dan menjahit.</p>\r\n\r\n<p>Salah satu program keputrian tersebut, yaitu memasak. Program tersebut merupakan kegiatan yang dapat meningkatkan kreativitas santriwati dalam hal memasak. Mereka belajar bagaimana cara menentukan bahan yang diperlukan sebelum memasak, menentukan takaran setiap bahan masakan, dan sampai proses memasak hingga masakan tersebut siap untuk dhidangkan.</p>\r\n\r\n<p>Pada tanggal 13-20 November 2021, santriwati SMP menjalankan program tersebut dengan bimbingan Ustadzah Lisiana. Mereka dibagi ke dalam beberapa kelompok dan mempunyai jadwal masing-masing untuk memasak. Dengan kreativitas yang mereka punya, mereka membuat berbagai jenis pasakan dari makanan manis sampai asin, seperti bola obi, lumpia coklat, jus mangga, pecel lele, nasi goreng, ayam suir, dan lain-lain. Santriwati terlihat sangat antusias dalam kegiatan tersebut, hal ini juga menunjukan bahwa program memasak memang bisa membuat mood santriwati lebih baik.</p>\r\n', '2022-11-21 16:10:46', 1, 'Pendaftaran', 54, 'a8aefb5c0117f9421721ea9fac3ff1d4.png', 1, 'Admin Santri', 0, 'kreativitas-santriwati-dalam-memasak', NULL, NULL, ''),
(189, 'IUBS Outstanding Student : Raima Sajidah Hanif	', '<p>Pondok Pesantren Ishlahul Ummah, Tasikmalaya. Dewasa ini, teknologi merupakan alat yang sangat penting bagi kehidupan manusia. Berbagai aktivitas yang dijalani tak luput dari penggunaan alat-alat canggih yang bisa memudahkan segala jenis pekerjaan manusia. Salah satu teknologi yang telah menjadi kebutuhan primer bagi manusia adalah smartphone. Hasil survey yang dilakukan oleh kominfo saja pada tahun 2017 menunjukan bahwa lebih dari setengah masyarakat Indonesia sudah memiliki telepon pintar atau smartphone. Fungsi smartphone sendiri memang untuk memudahkan manusia dalam hal komunikasi seperti lewat telepon ataupun sosial media. Tetapi, penggunaan teknologi smartphone zaman sekarang tidak hanya terbatas dalam hal itu saja. Smartphone bisa menjadi sebuah alat bagi manusia untuk membuat sebuah karya, seperti konten sosial media, poster dan lain-lain, hingga menghasilkan sebuah prestasi.</p>\r\n\r\n<p>Salah satu santriwati SMA IT pondok pesantren Ishlahul Ummah yaitu Raima Sajidah Hanif. Dia berhasil memenangkan 2 lomba poster sekaligus yaitu Juara 1 Social Walfare Poster Digital Competition 2021, dan Juara 2 lomba poster Anekdot dalam acara Gebyar Bulan Bahasa dan Sastra Indonesia, Universitas Siliwangi. Kedua Poster tersebut dibuat menggunakan aplikasi di smartphone pada saat liburan semester. Prestasi membanggakan tersebut lalu di apresiasi oleh pihak SMA IT yang mewakili yayasan Ishlahul Ummah dengan pemberian 2 piagam penghargaan bagi Raima. Hal ini menunjukan bahwa walaupun terbatasnya penggunaan gadget di lingkungan pondok pesantren, santriwati masih bisa berprestasi dengan hanya bermodalkan smartphone yang digunakan saat liburan. Pondok pesantren Ishlahul Ummah sendiri juga mempunyai Program Unggulan yaitu IT untuk mewadahi minat dan bakat santriwati dalam bidang IT agar semakin banyak santriwati yang bisa berprestasi.</p>\r\n\r\n<p>Selamat Raima!</p>\r\n', '2022-11-21 16:16:34', 6, 'Prestasi', 123, '4212508afec07c00ab646377377f8cd4.png', 1, 'Admin Santri', 0, 'iubs-outstanding-student-:-raima-sajidah-hanif', NULL, NULL, ''),
(190, 'Amaliyah Tadris Melatih Kemampuan Mengajar Santriwati', '<p>Kegiatan Amaliyah Tadris (praktik mengajar) merupakan kesempatan santri untuk latihan mengajar dan mendapatkan ilmu mengajar di depan adik kelasnya. Pondok Pesantren Ishlahul Ummah sendiri telah melaksanakan kegiatan tersebut pada tanggal 08-12 November 2021. Kegiatan tersebut hanya diperuntukan bagi santriwati SMA kelas 12. &nbsp;Mata pelajaran yang dibawakan oleh para peserta tersebut merupakan pelajaran pondok yg menggunakan bahasa Arab dan bahasa inggris dan disesuaikan dengan kemampuan peserta amaliyah tadris.</p>\r\n', '2022-11-21 16:22:10', 1, 'Pendaftaran', 65, 'd69af2a4cf0fdefecb59a80555431f6c.png', 1, 'Admin Santri', 0, 'amaliyah-tadris-melatih-kemampuan-mengajar-santriwati', NULL, NULL, ''),
(191, 'Tolong Menolong Kepada Sesama', '<p>Tolong Menolonglah Kepada Sesama</p>\r\n\r\n<p>&ldquo; Dan tolong menolonglah kamu dalam(mengerjakan) kebajikan dan takwa dan jangan tolong menolong dalam berbuat dosa dan pelanggaran. Dan bertakwalah kamu kepada Allah, sesungguhnya Allah amat berat siksa-nya&rdquo; (QS. Al-Maidah : 2)</p>\r\n', '2022-11-21 16:25:59', 7, 'alumni', 72, 'c69a0750a632057770519d7e3349e4c9.png', 1, 'Admin Santri', 0, 'tolong-menolong-kepada-sesama', NULL, NULL, ''),
(192, 'Jumat Berbagi 3 Desember 2021	', '<p>Jum&#39;at Berbagi, 3 Desember 2021</p>\r\n\r\n<p>Ishlahul Ummah Peduli merupakan sebuah lembaga Amil Zakat (LAZ) di yayasan Ishlahul Ummah, dengan program sebagai berikut :</p>\r\n\r\n<p>1. Jumat Berbagi<br />\r\n2. Perelek Beras<br />\r\n3. Beasiswa Santri<br />\r\n4. Wakaf Quran<br />\r\n5. Wakaf Mesjid</p>\r\n\r\n<p>Salah satu program yang dijalankan adalah jum&rsquo;at berbagi. Jum&rsquo;at berbagi merupakan kegiatan berupa sedekah makanan kepada masyarakat yang berada di sekitar pondok pesantren ishlahul ummah.</p>\r\n\r\n<p>Bagi yang ingin berdonasi bisa menghubungi nomor yang dibawah ini :</p>\r\n\r\n<p>- 0821-1876-7212 (Usth.Lusi)</p>\r\n\r\n<p>Atau bisa langsung tf ke no.rek. berikut dan konfirmasi ke nomor wa diatas</p>\r\n\r\n<p>- BSI A/N. Yayasan Ishlahul Ummah TSM 7086768881</p>\r\n', '2022-11-21 16:31:49', 1, 'Pendaftaran', 53, 'e2f24b2dddc8ec4d225431d9b70c0c0d.jpg', 1, 'Admin Santri', 0, 'jumat-berbagi-3-desember-2021', NULL, NULL, ''),
(193, 'Pemberian Penghargaan Lomba Internal Pramuka SMP IT Ishlahul Ummah', '<p>Pramuka merupakan salah satu ekstrakurikuler wajib yang ada di pesantren Ishlahul Ummah, berbagai kegiatan dilakukan untuk melatih keterampilan santriwati dalam hal &nbsp;berorganisasi, kepemimpinan, dan tanggung jawab. &nbsp; Salah satu kegiatan yang dilakukan pada hari Jum&#39;at, 26 November 2021, yakni perlombaan internal di SMP IT Ishlahul Ummah, perlombaan tersebut dibagi dalam beberapa kategori, yaitu lomba tari semaphore, paskibra, tersemangat, terdisiplin, hingga peserta terbaik. Selamat bagi para pemenang!</p>\r\n', '2022-11-21 16:34:50', 6, 'Prestasi', 84, 'd9bc6398827667713c4e11d8d7fa1a7c.png', 1, 'Admin Santri', 0, 'pemberian-penghargaan-lomba-internal-pramuka-smp-it-ishlahul-ummah', NULL, NULL, ''),
(194, 'Inspirational Dakwah by Dr Khalid Saad Samuli	', '<p>Inspirational Da&#39;wah by Dr Khalid Saad Samuli<br />\r\n15 Desember 2021<br />\r\n<br />\r\nDisela-sela kegiatan daurah pengambilan sanad tilawah Al-Qur&#39;an, kami mengadakan sebuah kegiatan ceramah oleh Dr. Khalid Saad Samuli dengan Ust. KH. Mohamad Rahman, BA.LLB. sebagai interpreter. Tema ceramah tersebut yaitu &quot;Keutamaan ibadah dan mencari Ilmu&quot;</p>\r\n', '2022-11-21 16:37:32', 1, 'Pendaftaran', 65, '4170cefb733c84230d507e09f8f9d7e0.png', 1, 'Admin Santri', 0, 'inspirational-dakwah-by-dr-khalid-saad-samuli', NULL, NULL, ''),
(195, 'Pemberian sanad tilawah alquran riwayat imam Hafz, dari imam asyim oleh Dr khalid saad samuli', '<p>Setelah kegiatan daurah pengambilan sanad tilawah Al-Qur&#39;an selesai dilaksanakan dari tanggal 13-17 Desember 2021, lalu dilanjutkan dengan acara pemberian ijazah dari Dr. Khalid Saad Samuli kepada para peserta. Acara tersebut dihadiri banyak pihak pesantren termasuk seluruh santriwati, guru, dan pimpinan yayasan.</p>\r\n', '2022-11-21 16:39:16', 1, 'Pendaftaran', 0, '6f7b1d495d38ff8a342678440b2cd26e.png', 1, 'Admin Santri', 0, 'pemberian-sanad-tilawah-alquran-riwayat-imam-hafz,-dari-imam-asyim-oleh-dr-khalid-saad-samuli', NULL, NULL, ''),
(196, 'Selamat dan Sukses atas Terpilihnya Pemimpin Baru PBNU	', '<p>Muktamar NU ke 34 telah selesai dilaksanakan, dan menghasilkan pemimpin baru PBNU. KH. Miftachul Akhyar ditetapkan sebagai Rais &lsquo;Aam Syuriah dan KH. Yahya Cholil Staquf sebagai ketua PBNU Periode 2021-2026, selamat mengemban amanah, semoga sukses.</p>\r\n', '2022-11-21 16:41:21', 1, 'Pendaftaran', 45, '15577515eee19c4f591586536c5657c0.png', 1, 'Admin Santri', 0, 'selamat-dan-sukses-atas-terpilihnya-pemimpin-baru-pbnu', NULL, NULL, ''),
(197, 'Twibbon Calon Santriwati Baru Ishlahul Ummah	', '<p>Assalamualaikum Wr. Wb, mari ramaikan PSB (Penerimaan Santriwati Baru) SMP-SMA IT Ishlahul Ummah Boarding School Tasikmalaya Tahun 2022/2023 dengan memakai Twibbon di profil sosial mediamu.Semoga kita selalu mendapatkan kebaikan. Aamiin</p>\r\n\r\n<p>Link Twibbon :&nbsp;&nbsp;<a href=\"https://twb.nz/siapmondokdiishlahulummah\">https://twb.nz/siapmondokdiishlahulummah</a></p>\r\n', '2022-11-21 16:43:39', 1, 'Pendaftaran', 38, 'a4176078da59bfad83820adfe0ef84bd.png', 1, 'Admin Santri', 0, 'twibbon-calon-santriwati-baru-ishlahul-ummah', NULL, NULL, 'https://twb.nz/siapmondokdiishlahulummah'),
(198, 'Program Unggulan : Bahasa Internasional.	', '<p>Bahasa merupakan alat yang dimiliki dan digunakan oleh manusia untuk berkomunikasi dengan manusia lainnya, sehingga kehidupan bersosial menjadi mudah. Terdapat banyak bahasa yang perlu kita pelajari selain bahasa ibu kita yaitu bahasa asing. Bahasa Inggris dan Bahasa Arab menjadi dua bahasa asing yang paling banyak digunakan di negara bagian barat dan timur bahkan skala internasional. Kedua bahasa tersebut penting untuk dipelajari karena dengan begitu kita akan lebih mudah berkomunikasi dengan orang asing.<br />\r\n<br />\r\nPondok Pesantren Ishlahul Ummah merupakan salah satu pesantren yang menerapkan kebiasaan menggunakan bahasa asing yaitu bahasa arab dan inggris dalam percakapan sehari-hari, kebiasaan ini tidak hanya diterapkan kepada santriwati saja, tetapi juga guru-guru. Tidak hanya itu, program ekstrakurikuler muhadhoroh dan muhadatsah turut menunjang santriwati agar kemampuan berbicara dan berbahasa asing mereka menjadi semakin terasah. &quot;A different language is a different vision of life&quot;. - federico fellini<br />\r\n&nbsp;</p>\r\n', '2022-11-21 16:45:45', 1, 'Pendaftaran', 51, '0d53cec28cf0fc3b7468659c5072e6ad.png', 1, 'Admin Santri', 0, 'program-unggulan-:-bahasa-internasional.', NULL, NULL, ''),
(199, 'Memasak bukan sebuah kewajiban bagi perempuan, tetapi beribadah dan belajar itu perlu', '<p>Kegiatan memasak menjadi suatu hal yang erat kaitannya dengan perempuan, walaupun bukan suatu kewajiban, tetapi kegiatan memasak ini ternyata bisa sekaligus menjadi kegiatan ibadah. Sebagai seorang muslimah, kita diamanahkan untuk bertanggung jawab atas rumah kita dan menjadi pemimpin didalam keluarga, setiap laki-laki memerankan pemimpin keluarga, setiap perempuan memerankan pemimpin di rumah bersama suami dan anak-anaknya.<br />\r\n<br />\r\nProgram keputrian yang ada di Pondok Pesantren Ishlahul Ummah mengajarkan santriwati beberapa kemampuan yang bisa di aplikasikan ketika sudah dewasa ataupun berkeluarga, yaitu kemampuan memasak dan menyulam. Merupakan sebuah rutinitas bagi santriwati Ishlahul Ummah melakukan kegiatan ini, karena mempelajari hal tersebut dirasa penting untuk bekal di masa depan.<br />\r\n<br />\r\n&quot;Menuntut ilmu itu wajib bagi setiap muslim&quot; HR. Ibnu Majah</p>\r\n', '2022-11-21 16:49:49', 1, 'Pendaftaran', 0, '16d6725388edd4f34ad2e1cae0a73bb4.png', 1, 'Admin Santri', 0, 'memasak-bukan-sebuah-kewajiban-bagi-perempuan,-tetapi-beribadah-dan-belajar-itu-perlu', NULL, NULL, ''),
(200, 'Bela Diri Pencak SIlat dan Taekwondo	', '<p>Bela diri merupakan suatu olahraga seni dalam mempertahankan atau membela diri. Di Indonesia sendiri terdapat banyak jenis bela diri yang bisa dipelajari seperti pencak silat dan taekwondo. Pencak silat yang berasal dari tanah air telah mencatatkan banyak prestasi di kancah internasional, begitupun dengan taekwondo dengan segudang prestasinya.<br />\r\n<br />\r\nOleh karena itu, Ishlahul Ummah menyelenggarakan eksrakurikuler dua bela diri tersebut sebagai bentuk komitmen melahirkan santriwati yang berprestasi dalam cabang olahraga bela diri.</p>\r\n', '2022-11-21 16:52:08', 1, 'Pendaftaran', 50, '0b1d7bbaf0277f17f1f4a2f8ee7b75b7.png', 1, 'Admin Santri', 0, 'bela-diri-pencak-silat-dan-taekwondo', NULL, NULL, ''),
(201, 'Ayo Mondok di Ishlahul Ummah	', '<p>Ishlahul Ummah Tasikmalaya, one of the best tahfizh boarding school in Indonesia<br />\r\n<br />\r\nPesantren Khusus Putri yang Unggul dalam Membangun Generasi Muslimah Cerdas dan Mandiri<br />\r\n<br />\r\nPondok Pesantren Ishlahul Ummah adalah Pesantren Khusus Putri yang berdasarkan nilai-nilai Ahlus Sunnah Wal Jamaah, yang berlokasi di Tasikmalaya, Jawa Barat. Pesantren ini memiliki 2 jenjang pendidikan, yaitu SMP dan SMA Islam Terpadu dan memiliki motto &quot;Sholehah, Cerdas dan Mandiri&quot;.<br />\r\n<br />\r\nAdapun program unggulan kami yaitu:<br />\r\n<br />\r\n1. Tahfidz Mutqin<br />\r\n2. Bahasa Internasional<br />\r\n3. IT<br />\r\n4. Keputrian<br />\r\n<br />\r\nJadwal Pendaftaran&nbsp;:<br />\r\nJanuari - Juni 2022 (Gelombang 2)<br />\r\n&nbsp;</p>\r\n', '2022-11-21 16:57:43', 1, 'Pendaftaran', 49, '9e984abedc7959494ae3831f84d04ec9.png', 1, 'Admin Santri', 0, 'ayo-mondok-di-ishlahul-ummah', NULL, NULL, ''),
(202, 'Ekstrakurikuler Kaligrafi dan Menggambar	', '<p>Belajar formal dikelas secara terus menerus terkadang membuat santriwati bosan, maka dari itu santriwati mengikuti ekstrakurikuler untuk mempelajari hal baru yang disukainya. Dari mulai ekskul beladiri, ekskul bahasa, sampai ekskul olahraga lainnya, santriwati bebas memilih ingin mengikuti ekskul manapun. Diantara ekstrakurikuler tersebut yang berjalan di Ishlahul Ummah adalah Kaligrafi dan Menggambar, dua ekstrakurikuler tersebut merupakan kegiatan dimana santriwati mengekspresikan diri dalam bentuk ide, gagasan, simbol, dsb. Kegiatan tersebut sangat bagus untuk melatih kemampuan motorik santriwati dengan bantuan beberapa alat gambar. Salah satu perbedaan dari keduanya adalah objek gambar, jika ekskul menggambar membuat gambar bebas, dan ekskul kaligrafi membuat tulisan-tulisan bahasa arab dengan keindahan.</p>\r\n', '2022-11-21 17:04:00', 1, 'Pendaftaran', 50, '098a107390c1599f6e746f9214de8699.png', 1, 'Admin Santri', 0, 'ekstrakurikuler-kaligrafi-dan-menggambar', NULL, NULL, ''),
(203, 'Workshop Peningkatan Kompetensi Guru dalam Memenuhi Kelengkapan Perangkat KBM	', '<p>Workshop Peningkatan Kompetensi Guru dalam Memenuhi Kelengkapan Perangkat KBM<br />\r\n<br />\r\nSMA IT Ishlahul Ummah Boarding School<br />\r\n<br />\r\n20-22 Januari 2022</p>\r\n', '2022-11-21 17:05:39', 8, 'Profil', 49, '585f007b42d7f73433420ccb0ec3fa59.png', 1, 'Admin Santri', 0, 'workshop-peningkatan-kompetensi-guru-dalam-memenuhi-kelengkapan-perangkat-kbm', NULL, NULL, ''),
(204, 'Sosialisasi Kampus Impian	', '<p>Sosialisasi Kampus Impian<br />\r\n20 Januari 2022<br />\r\n<br />\r\nMasa depan pastinya harus direncanakan dengan baik-baik, dengan matang. Ingin jadi apa ketika sudah dewasa nanti, bidang apa yang ingin dikuasai. Salah satu hal yang mesti dipikirkan mengenai masa depan yaitu &quot;mau kuliah dimana nanti?&quot;. Muncul beragam pilihan kampus-kampus terbaik yang bisa jadi target impian. Oleh karena itu, SMP-SMA IT Ishlahul Ummah Boarding School mengadakan sebuah sosialisasi Kampus Impian bersama beberapa kampus yang ada di Tasikmalaya, yaitu Universitas Siliwangi, Universitas Muhammadiyah, Politeknik Kesehatan TSM, dan STIKes BTH TSM. Masing-masing kampus tersebut menjelaskan mengenai profil kampus mereka dengan beragam jurusan unik yang bisa dipilih. Tapi tidak hanya itu, poin penting yang mereka jelaskan yaitu mengenai pentingnya kuliah, entah dimana pun itu, di Tasikmalaya atau di luar kota, yang penting kita mendapatkan ilmu terbaik yang bisa kita kuasai, dan menguasai skill-skill yang bisa berguna untuk karir nanti.</p>\r\n', '2022-11-21 17:07:03', 8, 'Profil', 49, '8c2761c2944ff0981a17dd3f57cac0e1.png', 1, 'Admin Santri', 0, 'sosialisasi-kampus-impian', NULL, NULL, ''),
(205, 'Sosialisasi Bahaya Bullying bersama Komisioner KPAD Tasikmalaya	', '<p>Sosialisasi Bahaya Bullying bersama Ibu Shita Nuryuliana, S.Psi, M.M. (Komisioner KPAD Kota Tasikmalaya)<br />\r\n<br />\r\n21 Januari 2022<br />\r\n<br />\r\nKegiatan sosialisasi ini penting untuk mengingatkan kepada santriwati mengenai bahayanya bullying atau perundungan, karena dampak yang dihasilkan akan sangat berpengaruh kepada mental health korban.</p>\r\n', '2022-11-21 17:12:41', 8, 'Profil', 66, '40c88feb1900d473203d848784e640d0.png', 1, 'Admin Santri', 0, 'sosialisasi-bahaya-bullying-bersama-komisioner-kpad-tasikmalaya', NULL, NULL, ''),
(206, 'Sosialisasi Bahaya Narkoba bersama Kasubbag Umum BNN Tasikmalaya	', '<p>Sosialisasi Bahaya Narkoba bersama Bapak Adi Rustawa, S.SOS (Kasubbag Umum BNN Kota Tasikmalaya)<br />\r\n<br />\r\n22 Januari 2022</p>\r\n', '2022-11-21 17:18:51', 8, 'Profil', 72, '8ef14e542c84b31233ba45be8c2877af.png', 1, 'Admin Santri', 0, 'sosialisasi-bahaya-narkoba-bersama-kasubbag-umum-bnn-tasikmalaya', NULL, NULL, ''),
(207, 'Ekstrakurikuler Paskibra	', '<p>Paskibra atau Pasukan Pengibar Bendera merupakan salah satu ekstrakurikuler yang ada di Pesantren Ishlahul Ummah. Berbagai manfaat yang bisa didapatkan dari mengikuti kegiatan ini adalah meningkatkan kedisiplinan santriwati, membangkitkan jiwa nasionalisme, melatih kemampuan baris berbaris, fokus, dan kekompakan tim. Salah satu kegiatan yang sering dilakukan oleh anggota Paskibra adalah upacara bendera yang dilakukan setiap hari senin pagi.</p>\r\n', '2022-11-21 17:20:48', 8, 'Profil', 57, '7c208999bb56a38ea29f62efe71abb20.png', 1, 'Admin Santri', 0, 'ekstrakurikuler-paskibra', NULL, NULL, ''),
(208, 'Donasi Untuk Kelas dan Asrama Santri	', '<p>Atap Ruang Kelas Tersapu Angin, Siswa Islahul Umah Terpaksa Belajar di Luar</p>\r\n\r\n<p>Cuaca buruk yang terjadi di berbagai kota di Indonesia pada Selasa, &nbsp;25 Januari 2022 telah menimbulkan banyak kerusakan. Hujan deras disertai angin kencang membuat beberapa bangunan roboh. Salah satunya ruang kelas di Ponpes Islahul Umah, Cihideung, Kota Tasikmalaya. Puluhan siswa terpaksa belaja di luar ruangan karena atap ruang kelas mereka roboh tersapu angin.</p>\r\n\r\n<p>Bagi Ibu/ Bapak yang ingin berdonasi untuk membangun kembali atap ruang kelas Ponpes Islahul Ummah, bisa langsung melalui:<br />\r\nRekening Donasi<br />\r\nBSI : 7086768881<br />\r\na.n. Yayasan Ishlahul Ummah<br />\r\nKode Bank 451</p>\r\n', '2022-11-21 17:22:38', 8, 'Profil', 100, '932329f59bb286eeca4e93e9487de18b.png', 1, 'Admin Santri', 0, 'donasi-untuk-kelas-dan-asrama-santri', NULL, NULL, ''),
(209, 'Memaafkan Kesalahan Ciri Orang Bertakwa	', '<p>Memaafkan Kesalahan Ciri Orang Bertakwa<br />\r\n<br />\r\n&quot;(Orang yang bertakwa yaitu) orang yang berinfaq, baik di waktu lapang maupun sempit, dan orang yang menahan amarahnya dan memaafkan (kesalahan) orang lain. Dan Allah mencintai orang yang berbuat kebaikan.&quot; (Q.S. Ali &#39;Imran : 134)<br />\r\n&nbsp;</p>\r\n', '2022-11-22 13:06:28', 8, 'Profil', 50, '2f87c1206301f4ac1ec45afc291919e6.png', 1, 'Admin Santri', 0, 'memaafkan-kesalahan-ciri-orang-bertakwa', NULL, NULL, ''),
(210, 'Doa Bulan Rajab', '<p>Alhamdulillah, kini kita telah memasuki bulan rajab, yang dimana bulan tersebut merupakan bulan penuh berkah. Pada umumnya, sebagai umat muslim kita diharuskan membaca do&#39;a ketika memasuki bulan rajab.</p>\r\n', '2022-11-22 13:13:17', 8, 'Profil', 57, '699f4372810fb33f5617df547f284718.png', 1, 'Admin Santri', 0, 'doa-bulan-rajab', NULL, NULL, ''),
(211, 'Doa Pagi Hari Rasulullah SAW	', '<p>Doa Pagi Hari Rasulullah SAW :<br />\r\n<br />\r\n<br />\r\nAll?humma bika ashbahn?, wa bika amsain?, wa bika nahy?, wa bika nam?tu, wa ilaikan nusy?ru<br />\r\n<br />\r\nArtinya, &ldquo;Ya Allah, dengan-Mu aku berpagi hari, dengan-Mu aku bersore hari, dengan-Mu kami hidup, dengan-Mu kami mati. Hanya kepada-Mu (kami) kembali,&rdquo; (HR Abu Dawud, At-Turmudzi, Ibnu Majah, dan lainnya).</p>\r\n', '2022-11-22 13:14:38', 8, 'Profil', 73, 'd64b6837783b247774b2566b124fe09c.png', 1, 'Admin Santri', 0, 'doa-pagi-hari-rasulullah-saw', NULL, NULL, ''),
(212, 'Ishlahul Ummah memfasilitasi minat dan bakat santriwati di berbagai bidang', '<p>10 Alasan Memilih Ishlahul Ummah</p>\r\n\r\n<p>#7. Memfasilitas minat dan bakat santriwati di berbagai bidang.<br />\r\nMempelajari berbagai ilmu di bidang akademik merupakan suatu hal yang utama ketika bersekolah. Para Santriwati berlomba-lomba untuk mendapatkan ilmu, nilai, dan prestasi terbaik. Namun, santriwati juga memiliki minatnya masing-masing terhadap suatu bidang ilmu di luar mata pelajaran yang diajarkan di kelas. Oleh karena itu, Ishlahul Ummah memfasilitasinya dengan menyediakan berbagai Ekstrakurikuler yang bisa diikuti baik dari jenjang SMP maupun SMA. Fungsi dari ekstrakurikuler itu sendiri bukan hanya untuk menyalurkan minat, tetapi juga mencetak prestasi non-akademik, sehingga prestasi tersebut bisa digunakan ketika melanjutkan ke dunia perkuliahan nanti.</p>\r\n', '2022-11-22 13:16:07', 8, 'Profil', 49, '51872302a8a32d433a8fb75b79ae0655.png', 1, 'Admin Santri', 0, 'ishlahul-ummah-memfasilitasi-minat-dan-bakat-santriwati-di-berbagai-bidang', NULL, NULL, ''),
