(215, 'Progres Renovasi Atap Kelas Pondok Pesantren Ishlahul Ummah', '<p>Alhamdulillah perbaikan atap kelas Pondok Pesantren Ishlahul Ummah Kota Tasikmalaya yang tersapu angin pada hari Selasa tanggal 25 Januari 2022 telah mencapai 70%.<br />\r\n<br />\r\nKami ucapkan terimakasih banyak kepada semua donatur yang telah memberi dukungan baik moril ataupun materi sehinga proses renovasi bisa berjalan.<br />\r\n<br />\r\nSemoga semua kebaikan donatur menjadi ladang pahala yang terus mengalir<br />\r\n<br />\r\nAmiin allahumma amiin ????</p>\r\n', '2022-11-22 13:19:33', 8, 'Profil', 48, 'b13253e534e3796ab3db31ade89e6399.png', 1, 'Admin Santri', 0, 'progres-renovasi-atap-kelas-pondok-pesantren-ishlahul-ummah', NULL, NULL, ''),
(216, 'Terima Kasih untuk para Donatur Renovasi Atap Kelas Pondok Pesantren Ishlahul Ummah', '<p>Alhamdulillah perbaikan atap kelas Pondok Pesantren Ishlahul Ummah Kota Tasikmalaya yang tersapu angin pada hari Selasa tanggal 25 Januari 2022 telah mencapai 70%.<br />\r\n<br />\r\nKami ucapkan terimakasih banyak kepada semua donatur yang telah memberi dukungan baik moril ataupun materi sehinga proses renovasi bisa berjalan.<br />\r\n<br />\r\nSemoga semua kebaikan donatur menjadi ladang pahala yang terus mengalir<br />\r\n<br />\r\nAmiin allahumma amiin ????</p>\r\n', '2022-11-22 13:22:46', 8, 'Profil', 49, 'c901cb769c9dea828919f30b20530586.png', 1, 'Admin Santri', 0, 'terima-kasih-untuk-para-donatur-renovasi-atap-kelas-pondok-pesantren-ishlahul-ummah', NULL, NULL, ''),
(217, 'Tersenyumlah seperti yang diajarkan Rasulullah SAW	', '<p>Tersenyumlah seperti yang diajarkan Rasulullah SAW<br />\r\n<br />\r\n&ldquo;Rasulullah SAW tidak pernah melarangku untuk menemui beliau sejak aku masuk Islam, dan beliau tidak pernah memandang ku kecuali dalam keadaan tersenyum di hadapanku.&ldquo;<br />\r\n(HR Bukhari dan Muslim).<br />\r\n<br />\r\n~<br />\r\n<br />\r\nKuota Pendaftaran Santriwati Baru semakin menipis, Pendaftaran Gelombang 2 juga akan segera ditutup, ayo segera daftar di Ishlahul Ummah!</p>\r\n', '2022-11-22 13:26:06', 8, 'Profil', 53, '6de28060b8ae6dd775eb813d2ee6def0.png', 1, 'Admin Santri', 0, 'tersenyumlah-seperti-yang-diajarkan-rasulullah-saw', NULL, NULL, ''),
(218, 'Jangan Bermalas-malasan	', '<p>Bekerjalah secukupnya, tapi jangan bermalas-malasan</p>\r\n\r\n<p>&ldquo;Dan Dialah yang menjadikan malam untukmu (sebagai) pakaian, dan tidur untuk istirahat, dan Dia menjadikan siang untuk berusaha.&rdquo; &nbsp;(QS Al-Furqan: &nbsp;47).</p>\r\n\r\n<p>~</p>\r\n\r\n<p>Kuota Pendaftaran Santriwati Baru semakin menipis, Pendaftaran Gelombang 2 juga akan segera ditutup, ayo segera daftar di Ishlahul Ummah!&nbsp;</p>\r\n\r\n<p>Untuk informasi pendaftaran SMP-SMA IT Ishlahul Ummah Boarding School Tasikmalaya bisa dilihat pada link dibawah ini :<br />\r\nhttps://Linktr.ee/PendaftaranSantriwatiBaruIUBS</p>\r\n\r\n<p>atau bisa menghubungi nomor/whatsapp :<br />\r\nSMP : 0813-3339-7700 (Usth.Rosiana)<br />\r\n&nbsp;0852-2359-8873 (Usth. Eli)<br />\r\nSMA : 0852-2399-1593 (Usth. Novi)<br />\r\n&nbsp;0813-2330-1993 (Usth. Ririn)</p>\r\n\r\n<p>#pesantrenputri #pesantrentasikmalaya #iubs #ishlahulummah #pondokpesantren #boardingschool</p>\r\n', '2022-11-22 13:28:12', 8, 'Profil', 106, '74c0149373de1a63a9b2e2c5f0098259.png', 1, 'Admin Santri', 0, 'jangan-bermalas-malasan', NULL, NULL, ''),
(219, 'Setiap Amal Tergantung Niatnya	', '<p>Setiap amal tergantung niatnya<br />\r\n<br />\r\n&quot;Sesungguhnya setiap amal itu (tergantung) pada niatnya, dan seseorang itu akan mendapatkan sesuai dengan yang dia niatkan.&quot; (HR. Bukhari)<br />\r\n<br />\r\n~<br />\r\n<br />\r\nKuota Pendaftaran Santriwati Baru semakin menipis, Pendaftaran Gelombang 2 juga akan segera ditutup, ayo segera daftar di Ishlahul Ummah!<br />\r\n<br />\r\nUntuk informasi pendaftaran SMP-SMA IT Ishlahul Ummah Boarding School Tasikmalaya bisa dilihat pada link dibawah ini :<br />\r\nhttps://Linktr.ee/PendaftaranSantriwatiBaruIUBS<br />\r\n<br />\r\natau bisa menghubungi nomor/whatsapp :<br />\r\nSMP : 0813-3339-7700 (Usth.Rosiana)<br />\r\n0852-2359-8873 (Usth. Eli)<br />\r\nSMA : 0852-2399-1593 (Usth. Novi)<br />\r\n0813-2330-1993 (Usth. Ririn)</p>\r\n', '2022-11-22 13:30:28', 8, 'Profil', 124, '738b2527bb0565e0a583767e59acab42.png', 1, 'Admin Santri', 0, 'setiap-amal-tergantung-niatnya', NULL, NULL, ''),
(221, 'Selesai liburan santri mulai kembali ke pondok', '<p>Tasikmalaya, 14 Januari 2023 - Pada akhir tahun, biasanya orang-orang menikmati liburan bersama keluarga, saudara, atau teman-temannya, hal ini dikarenakan pemerintah memberikan cuti bersama pada akhir tahun.&nbsp;Di Pondok Pesantren Ishlahul Ummah, santriwati menikmati liburan panjang selama 3 minggu sampai dengan 14 Januari 2023. Liburan bagi santriwati sangat berarti dan dibutuhkan mengingat setelah 6 bulan tinggal di pondok, mereka harus dipertemukan kembali dengan keluarganya di rumah masing-masing untuk me-<em>refresh</em> jiwa dan pikiran nya untuk mempersiapkan diri di semester berikutnya.</p>\r\n\r\n<p>Hari ini, setelah libur panjang tersebut, santri mulai datang kembali ke pondok dengan jiwa yang berbeda dan lebih semangat untuk menuntut ilmu di pondok. Kedatangan santri tersebut dimulai dari pagi pukul 08.00 sampai dengan 12.00 untuk santri/siswi SMP dan pukul 13.00 sampai dengan 15.00 untuk santri/siswi SMA. Alhamdulillah proses kedatangan tersebut berjalan dengan lancar dan hampir semua santri telah datang kembali ke IU, Ahlan wa sahlan santri terbaik Ishlahul Ummah!</p>\r\n', '2023-01-19 02:24:17', 9, 'Kegiatan Santriwati', 94, 'dc40b95278910e1027fdb27a9b4e7133.jpg', 1, 'Admin Santri', 0, 'selesai-liburan-santri-mulai-kembali-ke-pondok', NULL, NULL, ''),
(222, 'Sosialisasi Kampus Impian : Universitas Jenderal Soedirman', '<p>Tasikmalaya, 19 Januari 2023 - Saat memasuki jenjang SMA, seharusnya siswa harus mulai memikirkan tentang karir kedepannya, ingin kuliah atau kerja dimana. Dimulai dari melihat minat dan pelajaran yang disukai atau&nbsp;yang menonjol dari masing-masing diri siswa tersebut, jika berminat&nbsp;dalam komputer bisa mempertimbangkan kuliah di jurusan komputer, dan jika berminat dalam psikologi bisa mengambil kuliah jurusan bimbingan konseling atau psikologi, dan lain sebagainya. Salah satu upaya kami dalam memfasilitasi siswa kami untuk memilih karir yang sesuai dengan diri santriwati yaitu dengan program Sosialisasi Kampus Impian. Pada Selasa, 17 Januari, 3 hari setelah santri datang kembali ke pondok, kami mengadakan sosialisasi tersebut dengan mahasiswa Tasikmalaya yang berkuliah di Universitas Jendera Soedirman. Mahasiswa tersebut memaparkan cara tes masuk univ tersebut dengan berbagai metode, dari jalur SPMB sampai Beasiswa. Mudah-mudahan dari sosialisasi tersebut, siswa kami bisa mendapatkan pencerahan mengenai karir mereka setelah lulus dari SMA.</p>\r\n', '2023-01-19 02:46:17', 9, 'Kegiatan Santriwati', 85, 'dc2e67cf178addac8943b956999eff63.jpg', 1, 'Admin Santri', 0, 'sosialisasi-kampus-impian-:-universitas-jenderal-soedirman', NULL, NULL, ''),
(223, 'Grand Opening IU Mart ', '<p>Hari ini, Kamis 9 Februari 2023, IU Mart minimarket Pondok Pesantren Ishlahul Ummah secara resmi dibuka oleh mudir pesantren yaitu Ust. KH. Mohammad Rahman, BA.LLB.<br />\r\n<br />\r\nMasyarakat sekitar dan Santriwati Ishlahul Ummah turut hadir dalam menyaksikan grand opening tersebut. Dengan IU Mart ini insya Allah bisa menjadi wadah untuk beramal, karena keuntungan yang dihasilkan akan disalurkan kembali dalam bentuk beasiswa yatim dan dhuafa, operasional pesantren dan untuk mendukung kegiatan para penghafal Al-Qur&rsquo;an Ishlahul Ummah agar tetap berjalan dengan lancar.</p>\r\n', '2023-02-23 06:33:42', 9, 'Kegiatan Santriwati', 50, '0dfd3b233b4523a1d9bdf8b65cbe1fed.jpg', 1, 'Admin Santri', 0, 'grand-opening-iu-mart', NULL, NULL, ''),
(224, 'Pembukaan Ishlahul Ummah Festival VIMYSE 2.0', '<p>&nbsp;</p>\r\n\r\n<p>Alhamdulillah, hari pertama penyelenggaraan Ishlahul Ummah Festival berjalan dengan lancar. Setelah dibuka oleh Ustadz KH. Mohamad Rahman, BA. LLB, acara kemudian dilanjutkan dengan penampilan Drama Contest dari santriwati yang sudah dibagi ke dalam beberapa kelompok. Mengingat acara festival tersebut Anak-anak terlihat sangat antusias mengikuti rangkaian kegiatan acara, mudah-mudahan</p>\r\n', '2023-02-23 06:35:35', 9, 'Kegiatan Santriwati', 40, 'd74f476a0a21a3201a42b8067ed47013.jpg', 1, 'Admin Santri', 0, 'pembukaan-ishlahul-ummah-festival-vimyse-2.0', NULL, NULL, ''),
(225, 'Antusiasme anak-anak mengikuti lomba drama contest VIMYSE', '<p>Alhamdulillah, hari pertama penyelenggaraan Ishlahul Ummah Festival berjalan dengan lancar. Setelah dibuka oleh Ustadz KH. Mohamad Rahman, BA. LLB, acara kemudian dilanjutkan dengan penampilan Drama Contest dari santriwati yang sudah dibagi ke dalam beberapa kelompok. Mengingat acara festival tersebut Anak-anak terlihat sangat antusias mengikuti rangkaian kegiatan acara, mudah-mudahan acara terlaksana dengan lancar sampai penutupan.</p>\r\n', '2023-02-23 06:38:26', 9, 'Kegiatan Santriwati', 37, 'd3ce2b8480afad4b1f4044a9c58a00cf.jpg', 1, 'Admin Santri', 0, 'antusiasme-anak-anak-mengikuti-lomba-drama-contest-vimyse', NULL, NULL, ''),
(226, 'Hari kedua Ishlahul Ummah Festival lomba eksternal dimulai', '<p>Memasuki hari kedua Ishlahul Ummah Festival 2.0, seluruh lomba eksternal jenjang SD dan SMP dimulai. Lomba tingkat SD yakni MHQ Juz 30 dan Pildacil diadakan di dua tempat yang berbeda yaitu panggung utama untuk pildacil dan gedung Aula untuk MHQ, dan lomba tingkat SMP yakni story telling di panggung utama setelah lomba pildacil selesai dan MHQ Juz 29 &amp; 30 di ruangan lantai 3 SMP. Peserta lomba yang berasal dari sekolah-sekolah se-Priangan timur tersebut beradu kecakapan sesuai dengan jenis lombanya, dari kepandaian mengolah kata, kepercayaan diri saat public speaking, dan hafalan Al-Qur&#39;an saat tes MHQ.<br />\r\n<br />\r\nSementara itu, santriwati Ishlahul Ummah pada hari ini mengikuti kegiatan Market Day, yang dimana tujuan dari market day ini untuk mengasah kreatifitas dan membangkitkan jiwa entrepreneurship santi. Berbagai jenis makanan ditawarkan kepada santriwati dan peserta lomba. Alhamdulillah, seluruh rangkaian acara IU fest hari ini terlaksana dengan lancar dan kondusif, selamat dan semangat bagi semua peserta, semoga hasilnya yang terbaik dan bisa menjadikan lomba ini sebagai pengalaman berharga untuk menjadi lebih baik kedepannya. aamiin.</p>\r\n', '2023-02-23 06:39:22', 9, 'Kegiatan Santriwati', 38, '41b16af446cf2793f65aabeae0d5744f.jpg', 1, 'Admin Santri', 0, 'hari-kedua-ishlahul-ummah-festival-lomba-eksternal-dimulai', NULL, NULL, ''),
(227, 'Penampilan guest star di penutupan IU Fest penuh takjub dan inspiratif', '<p>Masya Allah, keren, takjub, luar biasa, atas rangkaian penampilan santri Ishlahul Ummah dan santri peserta lomba eksternal yang tampil maksimal pada setiap lombanya , begitupun dengan guest star IU Fest kali ini yakni teh&nbsp;<a href=\"https://www.instagram.com/gdaghaida/\">@gdaghaida</a>&nbsp;dan&nbsp;<a href=\"https://www.instagram.com/ali_sastra/\">@ali_sastra</a>&nbsp;! Di hari ketiga ini, sebagai penutup, IU Festival menyajikan talkshow inspiratif bagi kaum muda oleh guest star teh ghaida tsurayya. Dengan segudang pengalamannya, kisah dalam perjalanan karirnya yang tak mudah, teh ghaida mampu menginspirasi semua santri Ishlahul Ummah yang insya Allah akan mengikuti jejak karir suksesnya, aamiin. Selain itu, ada penyanyi nasyid kang&nbsp;<a href=\"https://www.instagram.com/ali_sastra/\">@ali_sastra</a>&nbsp;yang begitu apik membawakan lagu-lagunya di panggung IU Fest, penampilannya cukup menghibur dan lagu-lagunya juga menginspirasi santriwati Ishlahul Ummah.<br />\r\n<br />\r\nRangkaian kegiatan hari ketiga tersebut lalu ditutup dengan pengumuman pemenang lomba dan pemberian hadiah lomba eksternal dan internal IU Fest 2023. Selamat kepada semua pemenang lomba, semoga bisa bermanfaat dan menjadi motivasi bagi santri lainnya agar bisa berprestasi. Tak lupa kami ucapkan terima kasih kepada semua pihak yang telah mendukung jalannya acara ini yaitu panitia, ustadz dan ustadzah yang membimbing, santriwati Ishlahul Ummah dan para sponsor. See you in Ishlahul Ummah Festival 3.0 2024!</p>\r\n', '2023-02-23 06:42:47', 9, 'Kegiatan Santriwati', 39, '0c6cee5074199f469f29819008067ab0.jpg', 1, 'Admin Santri', 0, 'penampilan-guest-star-di-penutupan-iu-fest-penuh-takjub-dan-inspiratif', NULL, NULL, ''),
(228, 'Penampilan guest star di penutupan IU Fest penuh takjub dan inspiratif', '<p>Masya Allah, keren, takjub, luar biasa, atas rangkaian penampilan santri Ishlahul Ummah dan santri peserta lomba eksternal yang tampil maksimal pada setiap lombanya , begitupun dengan guest star IU Fest kali ini yakni teh&nbsp;<a href=\"https://www.instagram.com/gdaghaida/\">@gdaghaida</a>&nbsp;dan&nbsp;<a href=\"https://www.instagram.com/ali_sastra/\">@ali_sastra</a>&nbsp;! Di hari ketiga ini, sebagai penutup, IU Festival menyajikan talkshow inspiratif bagi kaum muda oleh guest star teh ghaida tsurayya. Dengan segudang pengalamannya, kisah dalam perjalanan karirnya yang tak mudah, teh ghaida mampu menginspirasi semua santri Ishlahul Ummah yang insya Allah akan mengikuti jejak karir suksesnya, aamiin. Selain itu, ada penyanyi nasyid kang&nbsp;<a href=\"https://www.instagram.com/ali_sastra/\">@ali_sastra</a>&nbsp;yang begitu apik membawakan lagu-lagunya di panggung IU Fest, penampilannya cukup menghibur dan lagu-lagunya juga menginspirasi santriwati Ishlahul Ummah.<br />\r\n<br />\r\nRangkaian kegiatan hari ketiga tersebut lalu ditutup dengan pengumuman pemenang lomba dan pemberian hadiah lomba eksternal dan internal IU Fest 2023. Selamat kepada semua pemenang lomba, semoga bisa bermanfaat dan menjadi motivasi bagi santri lainnya agar bisa berprestasi. Tak lupa kami ucapkan terima kasih kepada semua pihak yang telah mendukung jalannya acara ini yaitu panitia, ustadz dan ustadzah yang membimbing, santriwati Ishlahul Ummah dan para sponsor. See you in Ishlahul Ummah Festival 3.0 2024!</p>\r\n', '2023-02-23 06:43:14', 9, 'Kegiatan Santriwati', 0, '437299b2e47c4ff05c4c5dafca24d680.jpg', 1, 'Admin Santri', 0, 'penampilan-guest-star-di-penutupan-iu-fest-penuh-takjub-dan-inspiratif', NULL, NULL, ''),
(229, 'Pemeriksaan Kesehatan Kelas 7 SMP IT Ishlahul Ummah Tasikmalaya', '<p>Pemeriksaan kesehatan SMP dan SMA Pesantren Ishlahul Ummah oleh Puskesmas Cilembang Tasikmalaya, semoga sehat-sehat yaa ananda sekalian</p>\r\n', '2023-02-23 06:46:07', 9, 'Kegiatan Santriwati', 43, 'e51143a9af90746252dd8f40eccd7c49.jpg', 1, 'Admin Santri', 0, 'pemeriksaan-kesehatan-kelas-7-smp-it-ishlahul-ummah-tasikmalaya', NULL, NULL, ''),
(230, 'Pemeriksaan Kesehatan Kelas 10 SMA IT Ishlahul Ummah Tasikmalaya', '<p>Pemeriksaan kesehatan SMP dan SMA Pesantren Ishlahul Ummah oleh Puskesmas Cilembang Tasikmalaya, semoga sehat-sehat yaa ananda sekalian</p>\r\n', '2023-02-23 06:47:53', 9, 'Kegiatan Santriwati', 85, '8d0c3aaf909eae30c26b3235946de2f5.jpg', 1, 'Admin Santri', 0, 'pemeriksaan-kesehatan-kelas-10-sma-it-ishlahul-ummah-tasikmalaya', NULL, NULL, ''),
(231, 'Selamat memperingati Isra Miraj 27 Rajab 1444 H', '<p>Selamat memperingati Isra Mi&#39;raj 27 Rajab 1444 H<br />\r\n<br />\r\nSemoga di momen ini menjadi pengingat bagi kita akan kebesaran Allah SWT dan menjadikan kita lebih bersemangat dalam beribadah maupun beramal baik, aamiin.</p>\r\n', '2023-02-23 06:48:56', 9, 'Kegiatan Santriwati', 84, '366b20ec2fbc5422eb49f806b995eac5.jpg', 1, 'Admin Santri', 0, 'selamat-memperingati-isra-miraj-27-rajab-1444-h', NULL, NULL, ''),
(232, 'Tabligh Akbar dalam memperingati Isra Miraj 1444 H', '<p>Tabligh akbar dalam rangka memperingati Isra Mi&#39;raj Nabi Muhammad SAW 27 Rajab 1444H bersama syeikh Prof. Dr. Khaled Saad Mohamed Elsamouli, M.A dari mesir.</p>\r\n', '2023-02-23 06:50:06', 9, 'Kegiatan Santriwati', 47, 'e3ef8fd39b64141adb737892cbf537e9.jpg', 1, 'Admin Santri', 0, 'tabligh-akbar-dalam-memperingati-isra-miraj-1444-h', NULL, NULL, ''),
(233, 'Parade tasmi SMP IT Ishlahul Ummah Tasikmalaya', '<p>&nbsp;</p>\r\n\r\n<p>Parade tasmi adalah&nbsp;<strong>agenda spesial rutin tahunan bagi para Siswa/i penghafal Al Quran</strong>&nbsp;, acara ini adalah bentuk rasa syukur kami kepada Allah serta bentuk apresiasi kami terhadap para Siswa/i yang selama ini berjuang untuk terus menghafal Al Quran, mempelajari Al Quran, serta mengamalkan Al Quranul Karim.</p>\r\n', '2023-02-23 06:51:38', 9, 'Kegiatan Santriwati', 43, '1541397e559a07311c1660bfcd5b8224.jpg', 1, 'Admin Santri', 0, 'parade-tasmi-smp-it-ishlahul-ummah-tasikmalaya', NULL, NULL, ''),
(234, '30 Hari Menuju Ramadhan', '<p>&nbsp;</p>\r\n\r\n<p>30 Hari Menuju Ramadhan<br />\r\n<br />\r\n&ldquo;(Beberapa hari yang ditentukan itu ialah) bulan Ramadhan, bulan yang di dalamnya diturunkan (permulaan) Al Quran sebagai petunjuk bagi manusia dan penjelasan-penjelasan mengenai petunjuk itu dan pembeda (antara yang hak dan yang bathil). Karena itu, barangsiapa di antara kamu hadir (di negeri tempat tinggalnya) di bulan itu, maka hendaklah ia berpuasa pada bulan itu.&rdquo;<br />\r\n<br />\r\n(QS. Al Baqarah: 185)</p>\r\n', '2023-02-23 06:52:54', 8, 'Profil', 105, '1651596385b09e739da17edac5fe31f3.jpg', 1, 'Admin Santri', 0, '30-hari-menuju-ramadhan', NULL, NULL, ''),
(235, 'Allysa Nabila Zahra juara 2 lomba olimpiade AMIPA pada action 10th ibadurrohman Tasikmalaya', '<p>Selamat kepada Allysa Nabila Zahra atas raihan prestasinya sebagai Juara 2 Olimpiade AMIPA pada Action 10th 2023 Ibadurrohman se-Jawa Bali.<br />\r\n<br />\r\nSemoga menjadi pengalaman berharga dan memotivasi agar lebih baik pada perlombaan berikutnya, aamiin.</p>\r\n', '2023-02-23 06:55:16', 6, 'Prestasi', 153, 'c0ae16a4cc407dc66dde1bdf5b761743.jpg', 1, 'Admin Santri', 0, 'allysa-nabila-zahra-juara-2-lomba-olimpiade-amipa-pada-action-10th-ibadurrohman-tasikmalaya', NULL, NULL, ''),
(236, 'Pembelajaran bahasa Arab bersama Syeikh asal Mesir', '<p>Pada minggu ini, pondok Pesantren Ishlahul Ummah kedatangan syeikh Prof. Dr. Khalid Samuli, MA. dari mesir. Selama satu bulan kedepan, beliau akan mengajar bahasa Arab, dari mulai level dasar sampai ke tahap public speaking ala native. Mengingat bahwa salah satu program unggulan kami yaitu bahasa Internasional, tentunya penting untuk mendatangkan penutur asli dari arab untuk meningkatkan kemampuan berbahasa arab santriwati.<br />\r\n<br />\r\nMudah-mudahan bermanfaat bagi santriwati dan bisa mendapatkan sebanyak-banyaknya ilmu dari syeikh, aamiin.<br />\r\n&nbsp;</p>\r\n', '2023-02-23 06:58:08', 8, 'Profil', 169, 'c6eba38d083cd6fd912df6caea90763e.jpg', 1, 'Admin Santri', 0, 'pembelajaran-bahasa-arab-bersama-syeikh-asal-mesir', NULL, NULL, ''),
(237, 'MENTARI (Moment Taaruf Santri) Hari Pertama ', '<p>kegiatan MENTARI (Moment Ta&rsquo;aruf Santri) adalah kegiatan yang dilakukan untuk memperkenalkan budaya, tata bangunan, peraturan, dan lainnya tentang sekolah ke peserta didik baru. Kegiatan MENTARI (Moment Ta&rsquo;aruf Santri) diselenggarakan oleh pihak sekolah selama 6 hari berturut-turut, mulai tanggal 25 Juli 2023 hingga 29 Juli 2023.<br />\r\n<br />\r\nBeragam kegiatan yang diberikan selama kegiatan MENTARI (Moment Ta&rsquo;aruf Santri) SMA-SMP IT Islahul Ummah berlangsung lancar dan hari pertama dimulai dengan pengenalan profil sekolah ,pengenalan guru,staf yang ada dilingkup sekolah.</p>\r\n', '2023-07-27 06:10:12', 9, 'Kegiatan Santriwati', 0, '7e8c5066efedbc6fc8ed21367435b9da.jpeg', 1, 'Admin Santri', 0, 'mentari-(moment-taaruf-santri)-hari-pertama', NULL, NULL, ''),
(238, 'MENTARI (Moment Taaruf Santri) Hari Kedua', '<p>Allhamdulillah Kegiatan MENTARI (Moment Ta&rsquo;aruf Santri) Hari Kedua berjalan lancar,terlihat semua santriwati baru&nbsp;semangat mengikuti Tes Psikotes&nbsp;</p>\r\n', '2023-07-27 06:20:07', 9, 'Kegiatan Santriwati', 0, '5377f6710129a2a164ad092bc35ff1ce.jpeg', 1, 'Admin Santri', 0, 'mentari-(moment-taaruf-santri)-hari-kedua', NULL, NULL, ''),
(239, 'MENTARI (Moment Taaruf Santri) Hari Ketiga', '<p>Allhamdulillah dihari ketiga kegiatan MENTARI (Moment Ta&rsquo;aruf Santri) peserta di bekali pengetahuan mengenai Bahaya Narkotika dan rokok, beserta pembekalan dari Guru BK mengenai Motivasi Semangat Belajar&nbsp;</p>\r\n', '2023-07-27 06:21:10', 9, 'Kegiatan Santriwati', 0, '02d24714fc1476c7349623ea27b04afb.jpeg', 1, 'Admin Santri', 0, 'mentari-(moment-taaruf-santri)-hari-ketiga', NULL, NULL, ''),
(240, '	MENTARI (Moment Taaruf Santri) Hari Kelima', '<p>Mentari 2023 Hari ke 5, Jum&#39;at 28 Juli 2023<br />\r\n<br />\r\n~<br />\r\n<br />\r\n&quot;Mendidik satu perempuan, mendidik satu generasi&quot;. (Dr. Moh. Hatta)</p>\r\n', '2023-09-18 04:20:04', 9, 'Kegiatan Santriwati', 0, 'f17c9309774e5726b34f76df3c575f45.jpg', 1, 'Admin Santri', 0, 'mentari-(moment-taaruf-santri)-hari-kelima', NULL, NULL, ''),
(241, 'MENTARI (Moment Taaruf Santri) Hari Keenam', '<p>Mentari 2023 Hari ke 6, Sabtu, 29 Juli 2023<br />\r\n<br />\r\n~<br />\r\n<br />\r\n&quot;Mendidik satu perempuan, mendidik satu generasi&quot;. (Dr. Moh. Hatta)</p>\r\n', '2023-09-18 04:21:18', 9, 'Kegiatan Santriwati', 0, '0f953d5bdc85e4d0c779c9a4e4a6a1f9.jpg', 1, 'Admin Santri', 0, 'mentari-(moment-taaruf-santri)-hari-keenam', NULL, NULL, ''),
(242, 'Morning Spirit  senin,31 Juli 2023', '<p>Morning Spirit pertama untuk santriwati baru. Cerita baru dimulai hari ini, mudah-mudahan ananda belajar dengan penuh semangat dan kebahagiaan!<br />\r\n<br />\r\n~<br />\r\n<br />\r\n&quot;Mendidik satu perempuan, mendidik satu generasi&quot;. (Dr. Moh. Hatta)</p>\r\n', '2023-09-18 04:22:51', 9, 'Kegiatan Santriwati', 0, '46bf03307b0cd85157ef25089e87221d.jpg', 1, 'Admin Santri', 0, 'morning-spirit--senin,31-juli-2023', NULL, NULL, ''),
(243, 'Nilai tertinggi dalam ujian massal Pondok Pesantren Ishlahul Ummah', '<p>Selamat bagi santriwati yang mendapatkan nilai tertinggi dalam ujian massal Pondok Pesantren Ishlahul Ummah pelajaran IMLA dan Bahasa Arab, berikut nama santri dengan nilai tertinggi di Pelajaran IMLA :<br />\r\n<br />\r\n1. Fakhira Khaerani Gunawan (Siswa Kelas IX SMP)<br />\r\n2. Ranisa Mayada A. (Siswa Kelas XI SMA)<br />\r\n<br />\r\nDan berikut nama santri dengan nilai tertinggi pada pelajaran Bahasa Arab :<br />\r\n<br />\r\n1. Keisa Fauziyah N. (Siswa Kelas IX SMP)<br />\r\n2. Rumaisha Nuril F. (Siswa Kelas IX SMP)<br />\r\n3. Ranisa Mayada A. (Siswa Kelas XI SMA)<br />\r\n<br />\r\nSemoga pencapaian ini membuka pintu kesuksesanmu di masa depan. Tetaplah rendah hati, teruslah belajar, dan raihlah prestasi yang lebih gemilang lagi.</p>\r\n', '2023-09-18 04:24:21', 9, 'Kegiatan Santriwati', 0, '18b1a641846feed85b646f71d1b04110.jpg', 1, 'Admin Santri', 0, 'nilai-tertinggi-dalam-ujian-massal-pondok-pesantren-ishlahul-ummah', NULL, NULL, '');
