(244, 'Alumni SMA IT Ishlahul Ummah Boarding School kota Tasikmalaya yang telah diterima di PTN', '<p>Selamat dan Sukses kepada alumni SMA IT Ishlahul Ummah Boarding School kota Tasikmalaya yang telah diterima di PTN. Semoga keberkahan menyertai kalian dalam mencari ilmu, aamiin.</p>\r\n', '2023-09-18 04:25:37', 6, 'Prestasi', 0, '5a50427376e167b64381f05c7337a597.jpg', 1, 'Admin Santri', 0, 'alumni-sma-it-ishlahul-ummah-boarding-school-kota-tasikmalaya-yang-telah-diterima-di-ptn', NULL, NULL, ''),
(245, 'Upacara Bendera, Senin 07 Agustus 2023', '<p>Upacara Bendera, Senin 07 Agustus 2023<br />\r\n<br />\r\n~<br />\r\n<br />\r\n&quot;Mendidik satu perempuan, mendidik satu generasi&quot;. (Dr. Moh. Hatta)</p>\r\n', '2023-09-18 04:27:48', 9, 'Kegiatan Santriwati', 0, 'f31105415667dd62b3eaed7b48e89b4e.jpg', 1, 'Admin Santri', 0, 'upacara-bendera,-senin-07-agustus-2023', NULL, NULL, ''),
(246, 'Olimpiade Bahasa Arab ke -6 Tahun 2023', '<p>Mohon doanya untuk santriwati yang akan berjuang pada Olimpiade Bahasa Arab ke -6 Tahun 2023, semoga diberikan kemudahan serta hasil yang terbaik. aamiin</p>\r\n', '2023-09-18 04:32:36', 9, 'Kegiatan Santriwati', 0, '2fe3311d1260d3997883f1b6509cc7f5.jpg', 1, 'Admin Santri', 0, 'olimpiade-bahasa-arab-ke--6-tahun-2023', NULL, NULL, ''),
(247, 'Selamat Hari Pramuka 14 Agustus 2023', '<p>Selamat Hari Pramuka!<br />\r\n14 Agustus 2023<br />\r\n<br />\r\nPramuka Sumber Daya Manusia yang Profesional dan Proposional.</p>\r\n', '2023-09-18 04:33:27', 9, 'Kegiatan Santriwati', 0, 'a40b20771817011c8af45dd921d1756a.jpg', 1, 'Admin Santri', 0, 'selamat-hari-pramuka-14-agustus-2023', NULL, NULL, ''),
(248, ' Pertanggungjawaban ISSU Periode 2022/2023 dan Pelantikan ISSU 2023/2024', '<p>Laporan Pertanggungjawaban ISSU Periode 2022/2023 dan Pelantikan ISSU 2023/2024<br />\r\n<br />\r\nBerikut susunan ISSU periode 2023/2024<br />\r\n<br />\r\nKetua issu : Alifa Mulia<br />\r\nSekretaris : aghnia<br />\r\nBendahara : karina<br />\r\nRohani<br />\r\nKetua : alinda<br />\r\nAnggota : 1. Hilpa<br />\r\n2. Najwa<br />\r\n3. Xania<br />\r\n4. Gina M<br />\r\n5. Raisya N<br />\r\n6. Raisa<br />\r\nKeamanan<br />\r\nKetua : shiera<br />\r\nAnggota : 1. Karina<br />\r\n2. Maryam<br />\r\n3. Irnis<br />\r\n4. Salma<br />\r\n5. Chelsea<br />\r\n6. Riffsa<br />\r\nBahasa<br />\r\nKetua : sofi<br />\r\nAnggota : 1. Ranisa<br />\r\n2. Aghnia<br />\r\n3. Siti nisrina<br />\r\n4. Millatina<br />\r\n5. Aurelia<br />\r\n6. Alifah M<br />\r\n<br />\r\nKebersihan<br />\r\nKetua : Ayu gita<br />\r\nAnggota : 1. Arum<br />\r\n2. Naila<br />\r\n3. Thalita<br />\r\n4. Nadia syafa<br />\r\n5. Miska<br />\r\n6. Laura<br />\r\n<br />\r\nKedapuran<br />\r\nKetua : Gita<br />\r\nAnggota : 1. Ridhiya<br />\r\n2. Naura<br />\r\n3. Tiara<br />\r\n4. Siti khoirunnisa<br />\r\n5. Gendis<br />\r\n6. Dian<br />\r\n<br />\r\nKoperasi<br />\r\nKetua : fathiya<br />\r\nAnggota : 1. Nyza<br />\r\n2. Afifah<br />\r\n3. Lulu<br />\r\n4. Salwa m<br />\r\n5. Asila<br />\r\n6. Ulayya</p>\r\n', '2023-09-18 04:34:18', 9, 'Kegiatan Santriwati', 0, 'c925edd833faf9196b52e5194c26a825.jpg', 1, 'Admin Santri', 0, 'pertanggungjawaban-issu-periode-2022/2023-dan-pelantikan-issu-2023/2024', NULL, NULL, ''),
(249, 'Sosialisasi Institut Agama Islam Tazkia @tazkiaofficial ', '<p>Sosialisasi Institut Agama Islam Tazkia&nbsp;<a href=\"https://www.instagram.com/tazkiaofficial/\">@tazkiaofficial</a>&nbsp;, bogor ke Pesantren Putri Ishlahul Ummah Tasikmalaya, Selasa 15 Agustus 2023.</p>\r\n', '2023-09-18 04:35:08', 9, 'Kegiatan Santriwati', 0, '1ee67b926032a80dfc71cac8a45c7229.jpg', 1, 'Admin Santri', 0, 'sosialisasi-institut-agama-islam-tazkia@tazkiaofficial', NULL, NULL, ''),
(250, 'Dirgahayu Indonesiaku yg ke 78', '<p>Dirgahayu Indonesiaku yg ke 78! Terus Melaju untuk Indonesia Maju! ????????????????????????</p>\r\n', '2023-09-18 04:36:29', 9, 'Kegiatan Santriwati', 0, '2feaebddb0a201fbe4162d499d8de389.jpg', 1, 'Admin Santri', 0, 'dirgahayu-indonesiaku-yg-ke-78', NULL, NULL, ''),
(251, 'Upacara peringatan Hari Kemerdekaan Indonesia yang ke-78 ', '<p>Bersama-sama kita merayakan momen bersejarah! Meskipun hujan menyapa di awal, semangat kemerdekaan tak pernah pudar. Upacara peringatan Hari Kemerdekaan Indonesia yang ke-78 berjalan lancar dan khidmat. Upacara mengingatkan kita akan perjuangan dan pengorbanan para pahlawan. Terima kasih kepada perwakilan dari TNI yang sudah berpartisipasi sebagai inspektur upacara ini yang turut membuat acara ini menjadi begitu berarti. ????????????&nbsp;<a href=\"https://www.instagram.com/explore/tags/harikemerdekaan/\">#HariKemerdekaan</a>&nbsp;<a href=\"https://www.instagram.com/explore/tags/indonesia78/\">#Indonesia78</a>&nbsp;<a href=\"https://www.instagram.com/explore/tags/semangatkebangsaan/\">#SemangatKebangsaan</a></p>\r\n', '2023-09-18 04:37:44', 9, 'Kegiatan Santriwati', 0, '3abd72a939a5f67fffd70648c698df49.jpg', 1, 'Admin Santri', 0, 'upacara-peringatan-hari-kemerdekaan-indonesia-yang-ke-78', NULL, NULL, ''),
(252, 'Workshop Peningkatan Kompetensi Guru tentang Metode Pembelajaran Desain ADLX dengan Pendekatan Terpa', '<p>Workshop Peningkatan Kompetensi Guru tentang Metode Pembelajaran Desain ADLX dengan Pendekatan Terpadu.<br />\r\n<br />\r\nSMP IT dan SMA IT Ishlahul Ummah Boarding School Tasikmalaya. 18 Agustus 2023</p>\r\n', '2023-09-18 04:38:30', 9, 'Kegiatan Santriwati', 0, '9a4ce20b44f461776c7bceb3b44d136b.jpg', 1, 'Admin Santri', 0, 'workshop-peningkatan-kompetensi-guru-tentang-metode-pembelajaran-desain-adlx-dengan-pendekatan-terpadu.', NULL, NULL, ''),
(253, 'Gladi bersih Asesmen Nasional SMA/MA Tahun 2023.', '<p>Gladi bersih Asesmen Nasional SMA/MA Tahun 2023.<br />\r\n<br />\r\nSenin, 21 Agustus 2023.</p>\r\n', '2023-09-18 04:40:45', 9, 'Kegiatan Santriwati', 0, '1355a12bbf8f3ec00604fa00972046e2.jpg', 1, 'Admin Santri', 0, 'gladi-bersih-asesmen-nasional-sma/ma-tahun-2023.', NULL, NULL, ''),
(254, 'Melalui Dongeng, Kita Bersama-sama Menyinari Hati untuk Palestina.', '<p>Bersama Kak Ucon dari KNRP Jawa Barat: Melalui Dongeng, Kita Bersama-sama Menyinari Hati untuk Palestina. ????? Acara telah sukses dilaksanakan, dan kami sangat senang melihat santriwati tersenyum, terinspirasi, dan bersatu dalam semangat kemanusiaan.</p>\r\n', '2023-09-18 04:41:40', 9, 'Kegiatan Santriwati', 0, 'd1c9bf067618aae9bb88edbd1a501963.jpg', 1, 'Admin Santri', 0, 'melalui-dongeng,-kita-bersama-sama-menyinari-hati-untuk-palestina.', NULL, NULL, ''),
(255, 'Selamat Menempuh Asesmen Nasional SMA/MA Tahun 2023.', '<h1>Selamat Menempuh Asesmen Nasional SMA/MA Tahun 2023.<br />\r\n<br />\r\nSMA IT Ishlahul Ummah Boarding School Tasikmalaya.<br />\r\n<br />\r\n28-29 Agustus 2023.</h1>\r\n\r\n<p>3 ming</p>\r\n', '2023-09-18 04:43:36', 9, 'Kegiatan Santriwati', 0, 'f81576aad1bc3027c2de32663a6b14fa.jpg', 1, 'Admin Santri', 0, 'selamat-menempuh-asesmen-nasional-sma/ma-tahun-2023.', NULL, NULL, ''),
(256, ' Manajemen Sistem Pesantren dengan Ustadz Hodam Wijaya, S.Pd.I. MPP', '<p>Acara In House Training hari ini, mengupas tuntas Manajemen Sistem Pesantren dengan Ustadz Hodam Wijaya, S.Pd.I. MPP.&nbsp;<a href=\"https://www.instagram.com/hodamwijaya/\">@hodamwijaya</a>&nbsp;Alhamdulillah, berjalan lancar dan ilmu yang diberikan begitu berharga bagi semua asatidz dan asatidzah. Sangat menginspirasi kami agar senantiasa terus belajar menjadi guru yang lebih baik untuk para santri.</p>\r\n', '2023-09-18 04:55:09', 9, 'Kegiatan Santriwati', 0, 'e15663183217c95974330baa66b29b3e.jpg', 1, 'Admin Santri', 0, 'manajemen-sistem-pesantren-dengan-ustadz-hodam-wijaya,-s.pd.i.-mpp', NULL, NULL, ''),
(257, 'Kajian Parenting di Pondok Pesantren Ishlahul Ummah Tasikmalaya, 27 Agustus 2023', '<p>Kajian Parenting di Pondok Pesantren Ishlahul Ummah Tasikmalaya, 27 Agustus 2023, menjadi titik terang bagi para orang tua santriwati. Ustadz Hodam Wijaya, S.Pd.I, MPP. memberikan pandangan mendalam mengenai parenting yang memotivasi para orang tua dalam mendidik anak.<br />\r\n<br />\r\nSetelah acara selesai, momen perkeluaran menjadi waktu berharga untuk berbagi pengalaman dan memperkuat ikatan antara anak dan orang tua. Semoga dengan parenting dan momen perkeluaran santriwati hari ini, ikatan antara pondok dan wali santri, dan juga anak dengan orang tua menjadi terus lebih baik.</p>\r\n', '2023-09-18 04:56:30', 9, 'Kegiatan Santriwati', 0, 'd0d9b5aaf144655aa80724e9dcff650f.jpg', 1, 'Admin Santri', 0, 'kajian-parenting-di-pondok-pesantren-ishlahul-ummah-tasikmalaya,-27-agustus-2023', NULL, NULL, ''),
(258, 'Upacara bendera Ishlahul Ummah Boarding School Tasikmalaya, Senin 28 Agustus 2023', '<p>Upacara bendera Ishlahul Ummah Boarding School Tasikmalaya, Senin 28 Agustus 2023</p>\r\n', '2023-09-18 04:57:31', 9, 'Kegiatan Santriwati', 0, 'e893114f7c49bc43ab0da62ad8f3b47c.jpg', 1, 'Admin Santri', 0, 'upacara-bendera-ishlahul-ummah-boarding-school-tasikmalaya,-senin-28-agustus-2023', NULL, NULL, ''),
(259, 'Seminar motivasi hari Sabtu, 02 September 2023', '<p>Semangat dakwah dan inspirasi berkarya mengalir begitu indah pada seminar motivasi hari Sabtu, 02 September 2023! ???? Bersama kang Elvas Asmi, S.Mn&nbsp;<a href=\"https://www.instagram.com/elvasasmi/\">@elvasasmi</a>, influencer dan produser film &#39;Halalkan atau Tinggalkan 3&#39;. Salah satu poin penjelasannya yaitu bagaimana cara membangun personal branding yang kuat di sosial media agar kemudian kita bisa berdakwah melalui berbagai platform dan bisa dijangkau banyak orang. Alhamdulillah, banyak manfaat yang bisa kami dapatkan, begitu berkesan, menginspirasi, dan menghibur. ????&nbsp;<a href=\"https://www.instagram.com/explore/tags/berkaryauntukdakwah/\">#BerkaryaUntukDakwah</a>&nbsp;<a href=\"https://www.instagram.com/explore/tags/seminarmotivasi/\">#SeminarMotivasi</a>&quot;</p>\r\n', '2023-09-18 04:58:59', 9, 'Kegiatan Santriwati', 0, 'cc57fd376c2e2d8b4c36bca91c4e910a.jpg', 1, 'Admin Santri', 0, 'seminar-motivasi-hari-sabtu,-02-september-2023', NULL, NULL, ''),
(260, '3 santriwati Ishlahul Ummah akan melaksanakan Tasmi', '<p>Barakallah fiik wa fii hifdzik.<br />\r\n<br />\r\nInsya Allah, 3 santriwati Ishlahul Ummah akan melaksanakan Tasmi pada Kamis, 07 September 2023. Mohon do&#39;anya agar diberikan kelancaran dalam pelaksanaannya ????????</p>\r\n', '2023-09-18 05:00:33', 9, 'Kegiatan Santriwati', 7, 'fa6ef83ce33a5cbdf2c495ae671bc2ca.jpg', 1, 'Admin Santri', 0, '3-santriwati-ishlahul-ummah-akan-melaksanakan-tasmi', NULL, NULL, ''),
(261, 'Menempuh Gladi Bersih ANBK Jenjang SMP Tahun 2023', '<p>Selamat Menempuh Gladi Bersih ANBK Jenjang SMP Tahun 2023.<br />\r\n<br />\r\nSMP IT Ishlahul Ummah Boarding School Tasikmalaya.<br />\r\n<br />\r\n28-29 Agustus 2023.<br />\r\n<br />\r\n~<br />\r\n<br />\r\nJadilah hafidzah yang shalihah, cerdas, dan mandiri dengan mondok di Ishlahul Ummah.<br />\r\nPondok Pesantren khusus putri yang aman, nyaman, dan berkualitas!<br />\r\n<br />\r\ndaftar sekarang, dan hubungi kami melalui :<br />\r\n1. Admin SMP 0812-1114-0017<br />\r\n2. Admin SMA 0822-4695-8334<br />\r\n<br />\r\nYuk Mondok!</p>\r\n', '2023-09-18 05:01:44', 9, 'Kegiatan Santriwati', 5, '3132bd3edd38794a9cd40ccec526201a.jpg', 1, 'Admin Santri', 0, 'menempuh-gladi-bersih-anbk-jenjang-smp-tahun-2023', NULL, NULL, '');
